2	97	25	Precisamos mudar o ponto de vista sobre a Origem (s) da(s) vida(s)	<blockquote class="fontsize-base quote">Às vezes o problema não está na falta de respostas, mas na má formulação das perguntas<br></blockquote><p style="text-align: center;">Nesse sentido, diretamente da <a href="http://zientzia.info/sobre-la-catedra/" target="_blank">Cátedra de Cultura Científica da UPV/EHU</a> o pesquisador <a href="http://biofisika.org/author/kruiz/" target="_blank">Dr. Kepa Ruiz Mirazo,</a> da UPV-EHU, nos explica como mudar o ponto de vista reformulando a pergunta. </p><br><p style="text-align: center;">[EUS/POR] “<strong>Biziaren jatorriari buruzko ikuspegia aldatu behar dugu</strong>” </p><p style="text-align: center;">"<strong>Precisamos mudar o ponto de vista sobre origem da vida</strong>"</p><p style="text-align: center;"><iframe width="500" height="281" src="//player.vimeo.com/video/171958576" frameborder="0" allowfullscreen=""></iframe></p><p>Com autorização do meu orientador, traduzi o brilhante vídeo em euskera para português. <br></p><p>"A vida é muito complexa e, portanto, temos dificuldades na hora de defini-la. No entanto, segundo nossa definição os seres vivos seriam <strong>sistemas autônomos</strong> que tem a capacidade de entrar em um <em>processo de evolução</em> (cambio).</p><p>Isto o que quer dizer? <strong>Por que são autônomos? </strong>Porque são capazes de <strong>produzir seus próprios ingredientes</strong>, de algum modo são <strong>fábricas de ingredientes</strong>. E por outra parte, graças a reprodução se cria diversidade, se tornam mais complexos, e tal e como explicou Darwin se inserem em um processo de evolução e isso dá a vida uma <em>dimensão coletiva e histórica</em>.  A vida foi criada há muito tempo, se estima que se criou há 3.800 milhões pelos vestígios que podemos encontrar nas rochas. Onde? Não sabemos exatamente...</p><blockquote class="fontsize-base quote" style="text-align: center;">...foi na água, no mar, na costa, provavelmente, em fumarolas submarinas ou em um charco... Mas não sabemos em quais condições se criou exatamente..</blockquote><p><a href="http://www.nature.com/nchem/journal/v7/n4/full/nchem.2219.html" target="_blank"><img src="/uploads/redactor_rails/picture/data/51/soup4.jpg" width="447" height="300" alt="A recipe for life itself? Precursors to amino acids, nucleosides and lipids can all be obtained from the same simple starting materials." style="width: 447px; height: 300px; display: block; margin: auto;"></a></p><blockquote class="fontsize-base quote"><em>Darwin famously conceived of a ‘warm little pond’ where life might have first arisen.</em><em></em><br></blockquote><p><a href="http://naukas.com/2015/03/30/mas-cerca-del-origen-de-la-vida-meteoritos-cianuro-y-quimica-de-sistemas/" target="_blank"><img src="/uploads/redactor_rails/picture/data/50/briones.jpg" width="576" height="420" alt="" style="width: 576px; height: 420px; display: block; margin: auto;"></a></p><p><em>Um cenário como esse pode intervir na origem da vida: distintos ambientes aquosos em contato com superfícies minerais, que em ocasiões podem mesclar sues componentes e desencadear novos processos biossintéticos. Fotografia de Carlos Biones (do Centro de Astrobiología de Madrid/INTA).</em></p><p><br></p><img src="/uploads/redactor_rails/picture/data/47/soup2.jpg"><p><img src="/uploads/redactor_rails/picture/data/44/fumarola.jpg" alt="" width="401" height="298" style="width: 401px; height: 298px; float: left; margin: 0px 10px 10px 0px;"></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><em>Hydrothermal Mounds</em><em>. Fumarolas submarinas. <img src="/uploads/redactor_rails/picture/data/49/fumarola3.jpg" alt="Fumarolas" style="display: block; margin: auto;"><span class="redactor-invisible-space"></span></em><br></p><p><img src="/uploads/redactor_rails/picture/data/45/soup.jpeg" width="453" height="306" alt="" style="width: 453px; height: 306px; float: right; margin: 0px 0px 10px 10px;"></p><p><em>Yellowstone National Park and </em><em>in the United State</em><span class="redactor-invisible-space"><em>. </em></span><br></p><p><br></p><p>"Através da biologia molecular a investigação sobre a origem da vida sempre se apresentou como um atalho desde a química, para saber quais eram as reações para lograr os biopolímeros (RNA, DNA, proteínas).<br></p><p>...</p><p>No século passado houve <strong>três teorias diferentes</strong>. A primeira reivindicava que as <strong>proteínas </strong>foram as primeiras que se originaram para guiar o metabolismo de alguma maneira. Segundo a segunda teoria os seres vivos tem que trabalhar a <em>reprodução e a evolução </em>e isso se pode fazer através da química, isto é, através de <strong>moléculas de RNA, DNA…</strong> Segundo essa teoria haveria que criar estas moléculas em primeiro lugar. Aos finais do século passado outra teoria defendia que em primeiro lugar tiveram que se originar os <strong>compartimentos e os lipídios</strong>.<br></p><p>Segundo minha opinião estas <strong>três teorias são errôneas</strong>, porque temos que mudar o ponto de vista geral. Temos que analisar desde o principio a <strong>interação dos antecessores químicos</strong> e isso nos dará novos resultados, novas ideias para seguir avançando na investigação. </p><p>No princípio, tínhamos um entorno químico complexo, mas de aí se criaram os primeiros compartimentos, vesículas e outros sistemas. As vesículas se converteram em protocélulas, protocélulas autônomas através de reações químicas. Partindo daí e através do passo no tempo estas protocélulas começaram a desenvolver mecanismos genéticos, herança … e graças a isso se inseriram nesse processo de evolução aberto (<em>open ended-evolution</em>)." <em>Criando a dimensão histórica da vida...</em></p><blockquote class="fontsize-base quote"><em>E é sobre o que é <strong>historicidade </strong>que o próximo post focará. A despeito da historicidade da vida, como podemos encontrar <strong>padrões profundos</strong> que se repetem?</em></blockquote><p><img src="/uploads/redactor_rails/picture/data/48/soup3.jpg" alt="" style="display: block; margin: auto;"></p><blockquote class="fontsize-base quote">O cambio de perspectiva proposto desde uma abordagem da “<a href="http://pubs.acs.org/doi/abs/10.1021/cr2004844" target="_blank">química de sistemas</a>” não é fácil de se fazer experimentalmente, mas é o que deve ser feito. Contribuindo com essa pesquisa podemos descobrir os <strong>ingredientes primários</strong> que deram origem a seres que continuam a se perguntar sobre suas origens. </blockquote><p>Leia mais em: <a href="http://mappingignorance.org/2014/03/21/living-beings-systems-way-back-chemical-origins/"></a><strong><a href="http://mappingignorance.org/2014/03/21/living-beings-systems-way-back-chemical-origins/" target="_blank">Living beings: systems all the way back to their chemical origins</a></strong></p><p><a href="http://mappingignorance.org/2015/04/27/opening-the-systemic-avenue-from-chemistry-to-biology/"></a><strong>                      <a href="http://mappingignorance.org/2015/04/27/opening-the-systemic-avenue-from-chemistry-to-biology/" target="_blank">Opening the systemic avenue from chemistry to biology</a></strong></p><p>By C. Briones <a href="http://naukas.com/2015/03/30/mas-cerca-del-origen-de-la-vida-meteoritos-cianuro-y-quimica-de-sistemas/"></a><strong><a href="http://naukas.com/2015/03/30/mas-cerca-del-origen-de-la-vida-meteoritos-cianuro-y-quimica-de-sistemas/" target="_blank">Más cerca del origen de la vida: meteoritos, cianuro y química de sistemas</a></strong></p><p><strong><a href="http://naukas.com/2015/03/30/mas-cerca-del-origen-de-la-vida-meteoritos-cianuro-y-quimica-de-sistemas/" target="_blank"></a></strong>Ruiz-Mirazo, K., Briones, C., de la Escosura A (2014). Prebiotic systems chemistry: new perspectives for the origins of life. <em>Chemical Reviews</em> 114: 285-366.</p><hr><p>Obrigada a todos que contribuíram, continuem compartilhando estamos no #day25 Darwin</p><p>Tripulaçao, dá um share simpático na nossa página do FB <a href="https://www.facebook.com/darwinismouniversal/">https://www.facebook.com/darwinismouniversal/</a></p><p><br></p>	2016-12-13 00:49:47.618862	2016-12-13 00:49:47.618862	f
5	14	16	No-Budget Science #08 - amanhã, 09/03, 16h 	<p>Quem somos? O que fazemos? Para onde vamos?</p><p>    Para ajudar a responder essas perguntas fundamentais, é com prazer que anunciamos o primeiro episódio da nova temporada do No-Budget Science, dedicado à discussão de nossos cursos e alunos de graduação e pós-graduação, a partir de dados que estão ao alcance da mão, se alguém fizer uma força pra levantá-los.</p><p>    A programação de nossa próxima edição, que rola no dia 9/3 (5<sup>a</sup> feira) às 16h no Auditório Leopoldo de Meis (CCS-UFRJ, ao lado da Farmácia Universitária) conta com o seguinte lineup:</p><p><strong>   Débora Foguel </strong>(IBqM-UFRJ) – O perfil socioeconômico do pós-graduando da UFRJ.</p><p><strong>   Cláudia Mermelstein </strong>(ICB-UFRJ) – Repensando a biologia celular no ensino de graduação</p><p><strong>   Júlia Drumond </strong>(ICB-UFRJ/IDOR) – Onde estão os egressos da pós-graduação? O que pensam os que ainda estão nela?</p><p>    Além disso, estamos convidando os coordenadores de PG do CCS para compor a mesa de discussão e nos ajudar a debater presente e futuro da pós-graduação (e dos pós-graduandos!).</p><p>    Nossa nova temporada contará com algumas novidades, a começar pelo No-Budget Science como disciplina da PG de Química Biológica da UFRJ, de forma a podermos conceder créditos pela participação. Dito isso, as palestras seguem abertas a todos, e a cerveja segue por conta dos bravos apoiadores de nosso crowdfunding.</p><p>    Esperamos vocês por lá!</p><p>    Um abraço,</p><p><strong>No-Budget Science</strong></p><p>Comissão Organizadora: Olavo Amaral (IBqM-UFRJ), Kleber Neves (ICB-UFRJ), Thiago Moulin (IBqM-UFRJ), Clarissa Carneiro (IBqM-UFRJ), Patrícia Bado (ICB-UFRJ)</p><p>Contato: <a href="mailto:nobudgetscience@gmail.com" target="_blank">nobudgetscience@gmail.com</a></p><p>Facebook: <a href="http://facebook.com/nobudgetscience" target="_blank">facebook.com/nobudgetscience</a></p><p>Twitter: <a href="http://twitter.com/nobudgetscience" target="_blank">twitter.com/nobudgetscience</a>      </p>	2017-03-08 14:27:07.930846	2017-03-08 14:27:07.930846	f
