13	143	37	A forma de um livro	<p>Pessoal,</p><p>O livro Experiências Tropicais de Angústia já está tomando forma. <br>Vejam a capa! <span class="_47e3 _5mfr"><img src="https://static.fgig4-1.fna.fbcdn.net/images/emoji.php/v9/f51/1/16/1f603.png" alt=""><span class="_7oe"></span></span></p><p>O livro conta também com a apresentação da professora Beatriz de Moraes Vieira. <br>Segue aí para vocês um trecho da apresentação do livro feita pela professora.</p><p>“Lendo os romances, os contos, as cartas, as Memórias do Cárcere, Natália Fontes Rodrigues aproximou-se da vertente que trabalha a relação entre história e literatura não apenas pelo viés sociológico, tampouco apenas pela dimensão formal e retórica. Nas palavras de Antonio Candido, trata-se da "passagem do dois ao três" com a superação da dicotomia entre forma e conteúdo sócio-histórico, a ser substituída por uma visão mais integradora e atravessadora, por assim dizer, entre estruturas textuais e mundanas. Desse modo, são consideradas e tratadas muitas correlações possíveis entre a historicidade e a literariedade, sem que se venham a subsumir os elementos estéticos nos sócio-históricos, nem vice-versa.” (VIEIRA, Beatriz de Moraes. “Apresentação”. In: RODRIGUES, Natália F. Experiências Tropicais de Angústia)</p><p>Saiba mais sobre, e adquira o livro no site: <br><a href="https://entropiacoletiva.com/pt/experienciasdeangustia" target="_blank" data-ft="{&quot;tn&quot;:&quot;-U&quot;}" data-lynx-mode="async" data-lynx-uri="https://l.facebook.com/l.php?u=https%3A%2F%2Fentropiacoletiva.com%2Fpt%2Fexperienciasdeangustia&h=ATMdWe-Y5Hiximu0cdBNo5MuT34d4CslQhc4VW0f5QgL9PUAt7ExZoCd13ssfQpET_friPUatYHT64Jrol5b2qYUmYdOYnxL4gLIZf9HPaozfAfie_Hi6-5bIwECcHU4Xg2BEeL65cqfrVGYWEp6t1nRRlRQ3mvFfwYocBaOVO70kKD21Lx8Cgt3dDXurcJ_3OYpUWkax2JhOJPEHD_w2JYhq9oR6u2VYrgpG-N71O-3Hkn0Ktb45H5J22amW_F10JRj49PKTpnAVXxNlEwb0-ds-Wg_Xs8AD6fH2Tps1qE-">https://entropiacoletiva.com/pt/experienciasdeangustia</a></p><p><img src="/uploads/redactor_rails/pictur