34	Teste Layout	139	28	18000.0	\N	\N	\N	2017-07-15 18:38:37.129567	2017-08-04 17:42:24.083784	<p><img src="/uploads/redactor_rails/picture/data/85/240d3e39-bc2f-40df-a865-40b4bf04e4de.jpg"><br></p><p style="text-align: justify;">O respeito e a valorização das pessoas com deficiência e/ou mobilidade reduzida, a promoção de seus direitos, a superação das barreiras sociais predominantes ao processo de inclusão, são de grande importância. Nossas ações inclusivas visam contribuir para que a pessoa com deficiência, mobilidade reduzida, participem efetivamente dos espaços sociais, e que suas oportunidades sejam ampliadas com a valorização de suas potencialidades. Reconhecemos sim que possam apresentar limitações de alguma ordem, mas essas não são incapacitantes e não diminuem o valor de suas personalidades e de suas potências. Passividade e penalidade precisam ser quebradas do senso crítico social, para que se enxerguem e valorizem essas pessoas, respeitando e atendendo suas demandas, colocando-a em igualdade. Nossa dedicação é contribuir com mudanças capazes de transformar a visão predominante sobre a deficiência, focando na valorização dessas pessoas, seres humanos que enfrentam seus desafios com muita segurança, capacidade e confiança. Seu diferencial está na realização de tantas potencialidades, quando ainda nos dias atuais lhes são impostas tantas barreiras e exclusões.</p><p style="text-align: justify;"><a href="http://www.reabilitarte.org" target="_blank"><img src="/uploads/redactor_rails/picture/data/93/logo_peito_esquerdo_frontal.png" width="396" height="398" alt="Site ReAbilitArte" style="width: 396px; height: 398px; display: block; margin: auto;"></a><span class="redactor-invisible-space"></span></p><p style="text-align: justify;" rel="text-align: justify;">O <strong>ReAbilitArte</strong> surge do desejo de um grupos de amigos, que em 2009 enxergava que o desenvolvimento de estratégias de diagnóstico e melhoria da acessibilidade arquitetônica, são direitos das pessoas com deficiência e um dever social e moral. Dessa forma, o <strong>ReAbilitArte</strong> pretende ser uma ferramenta de transformação social para as pessoas com deficiências físicas e seus cuidadores, oferecendo informação científica, prática e trabalho no processo de reeducação e readaptação da sociedade. Além disso, temos ainda uma participação como atividade de <strong>extensão</strong> da <strong>Universidade Federal do Rio de Janeiro</strong>.</p><p><a href="https://www.facebook.com/reabilitarte.org/" target="_blank"><img src="/uploads/redactor_rails/picture/data/89/arads.png" alt="Facebook ReAbilitArte" style="display: block; margin: auto;"></a><br></p><p style="text-align: justify;" rel="text-align: justify;">Em nossa fase piloto mapeamos a acessibilidade das unidades e de todo o campi da <strong>UFRJ-</strong><strong> Cidade Universitária</strong>, tendo como meta principal: <strong>se</strong><strong> expandir para as cidades</strong>; para tal acabando de percorrer o estado do RJ, a extensão dos campus da UFRJ como Macaé, Xerém e Praia vermelha, outras instituições de ensino, englobando todos os espaços públicos e privados. </p><p style="text-align: justify;">Essa vertente é norteada pelo: </p><p class="fontsize-large">Mapas de Acessibilidades Inteligentes - <strong>MAI</strong></p><p><a href="http://www.mapaacessibilidade.tk" target="_blank"><img src="/uploads/redactor_rails/picture/data/90/mapaa.png" alt="MAPA ACESSIBILIDADE" style="display: block; margin: auto;"></a></p><p><img src="/uploads/redactor_rails/picture/data/102/frasegif.gif"></p><p class="fontsize-large">Visamos angariar custas para: </p><ul><li>O deslocamento de pessoas portadoras de qualquer tipo de deficiência que sejam colaboradoras do projeto e que nos ajudam na realização do mapeamento;  </li><li>Contratação de profissionais especializados para o aperfeiçoamento da nossa equipe e também das ferramentas desenvolvidas pelo grupo;</li><li>Desenvolvimento de tecnologias e adaptações assistivas, entre outras.</li></ul><p class="fontsize-large"><strong><u>Missão</u></strong></p><p class="fontsize-large" style="text-align: justify;">Proporcionar reabilitação neuro locomotora de excelência, priorizando o atendimento da população de baixa renda do subúrbio do Rio de Janeiro, através de intervenções locais em educação, prevenção, tratamento e pesquisa clínica. </p><p><img src="/uploads/redactor_rails/picture/data/78/promov.gif"></p><p><br></p><p style="text-align: justify;">O movimento para inclusão social das pessoas com deficiência (PCD) começou após a <strong>Segunda</strong><strong> Guerra Mundial </strong>quando ocorreu a elaboração da: Declaração Universal dos Direitos Humanos, pela Assembléia Geral da Organização das Nações Unidas - ONU, em <strong>1948</strong>.</p><p style="text-align: justify;"><strong>Somente em 1993</strong>, foi instituída no Brasil uma Política Nacional para a Integração da Pessoa Portadora de Deficiência, na qual suas diretrizes determinavam a inclusão da pessoa com deficiência em todas as iniciativas governamentais relacionadas à educação, saúde, trabalho, edificação pública,seguridade social, transporte, habitação, cultura, esporte e lazer (BRASIL,1993, art. 5º, inc. III).<img src="/uploads/redactor_rails/picture/data/106/grafic1607.gif"></p><p><br><br></p><p><img src="/uploads/redactor_rails/picture/data/107/graf1607.gif"></p><p><img src="/uploads/redactor_rails/picture/data/83/criminal.png"><br></p><p><img src="/uploads/redactor_rails/picture/data/84/aumento.gif"><br></p><p class="fontsize-larger fontweight-semibold" style="text-align: justify;">Mesmo com todas essas políticas que vêm sendo adotadas nessas últimas décadas, a participação de PCDs no mercado de trabalho ainda é insignificante e para que essas pessoas consigam entrar no mercado de trabalho se faz necessário sua qualificação, o que significa inseri-las no contexto das Universidades. E estas também precisam se adaptar para recebê-las, com instalações adequadas.</p><p><img src="/uploads/redactor_rails/picture/data/101/fr.gif" width="679" height="426" style="width: 679px; height: 426px;"></p><p><img src="/uploads/redactor_rails/picture/data/110/gif1607.gif" width="683" height="120" style="width: 683px; height: 120px; display: block; margin: auto;" alt=""></p><p style="text-align: center;" rel="text-align: center;"><a href="http://www.reabilitarte.org/">ReAbilitArte.org</a> - <a href="https://www.facebook.com/pages/ReAbilitArte/223349777684236?sk=wall">ReAbilitArte no Facebook</a> -</p><p style="text-align: center;"> <a href="https://www.youtube.com/channel/UC_4YzBEZH5cOcZfhCM_NG0A/playlists">ReAbilitArte no Youtube</a> - <a href="http://mapasacessibilidade.tk/">Mapas de Acessibilidade Inteligentes</a><br></p>	f	\N	deleted_project_34	\N	deleted	60	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	'34':5C 'arquitetur':6B 'deleted':3C 'layout':2A 'project':4C 'test':1A 'urban':8B	\N	\N	f	t	f
