16	No-Budget Science	14	34	1000.0	Um laptop na mão e uma ideia na cabeça!	\N	\N	2016-10-16 15:08:23.28138	2017-03-06 14:32:30.18181	<p>A\r\npremissa do No-Budget Science é que nem toda ciência precisa de bancada. Nem de\r\npipetas, laboratório, células, ratos, ou q<span class="textexposedshow">ualquer\r\nrecurso material. E às vezes nem de dinheiro.</span></p><p>É\r\nclaro que boa parte da ciência precisa disso tudo, e não estamos em absoluto\r\nquerendo desmerecer o feijão-com-arroz experimental de todos os dias. Mas nossa\r\nideia é mostrar que, com uma ideia na cabeça e um notebook na mão, já dá pra\r\nfazer muita coisa. E que às vezes essas coisas podem ser até mais importantes\r\ndo que um projeto convencional. Porque em um mundo cheio de gente produzindo\r\ndados, resultados, teses e artigos, às vezes o que mais se precisa é de alguém\r\nque consiga olhar pra esses dados de outro jeito – o que frequentemente não\r\ncusta nada.</p><p>Nossa\r\nideia, assim, tem sido juntar gente que esteja desenvolvendo (ou queira\r\ndesenvolver) projetos que (a) estejam pelo menos vagamente relacionados à\r\nbiologia, (b) sejam exequíveis a partir de dados publicamente disponíveis ou de\r\nfácil acesso e (c) não custem mais do que seu notebook, sua conexão à internet\r\ne seu tempo. E a partir daí, discutir projetos e ideias em um ambiente o mais\r\ninformal possível.</p><p>O\r\nevento já teve 5 edições, sempre nas dependências do Centro de Ciências da\r\nSaúde da UFRJ (mas também com disponibilização online das palestras), com um\r\nsucesso de público razoável. Com três a quatro palestras por edição, já\r\ndiscutimos econofísica, reprodutibilidade científica, biohacking,\r\nbioinformática, modelos matemáticos em neurociência e padrões de comportamento\r\nem sites adultos, entre outros temas, e todos os eventos renderam pelo menos\r\numa hora de discussão com o público após as palestras. Pra manter o debate\r\nrolando, bem como o clima de informalidade do evento, sempre contamos com um\r\nisopor de cerveja gratuita, com o patrocínio inicial de nossos bolsos e da\r\nEntropia Coletiva. Como essa parte do evento é inevitavelmente "budget", no entanto, gostaríamos de\r\npedir sua ajuda para mantê-lo neste formato, agora com o apoio da\r\ncomunidade que se formou ao redor do No-Budget.</p><p>Por\r\nedição anterior gastamos entre 100 e 150 reais com cerveja, refrigerante,\r\namendoim e impressões de cartazes para divulgação. Descontada a taxa da plataforma, 1000\r\nreais é mais do que o suficiente para mantermos o evento vivo e vibrante por\r\nmais seis edições. De qualquer forma, se atingirmos metade da meta, já\r\ngarantimos a continuação do evento por mais três edições.</p><p>Se\r\nbatermos a meta dos mil reais, colocaremos em discussão com a comunidade como\r\ninvestir a verba extra nos próximos eventos. Possibilidades incluem (a) mais\r\ncerveja, (b) aprimoramento dos petiscos oferecidos, (c) aprimoramento da transmissão online, (d) viabilização de palestrantes de fora do RJ e (e) utilização dos\r\nrecursos para edições do No-Budget Science fora da UFRJ e/ou para o projeto\r\nCiência à Deriva, que visa levar a discussão para a Baía de Guanabara! </p><p>A\r\nnossa programação inclui a realização da edição #6 em novembro e #7 em dezembro. Paramos para as férias e retornamos em 2017 para mais três\r\nedições.</p><p>É\r\nclaro que os nossos financiadores serão devidamente recompensados! Todos os doadores receberão acesso a uma pasta compartilhada contendo artigos\r\nselecionados sobre os temas discutidos a cada edição, independente do valor\r\ndoado, e constarão em nossa lista de apoiadores, a ser divulgada por nossas mídias sociais. Além disso, os doadores podem optar por três recompensas:</p><p>-\r\n15 cadeiras cativas (estrategicamente localizadas próximo ao isopor) para quem\r\ndoar pelo menos 25 reais;</p><p>- 50 porta-latinhas do evento para quem doar pelo menos 30 reais;</p><p>- 50 livros autografados de Olavo Amaral (idealizador do evento e CEO da\r\ncorporação No-Budget Science durante as primeiras edições) para quem doar pelo\r\nmenos 50 reais.</p>	\N	\N	nobudgetscience	\N	online	37	2016-10-18 18:27:10.52178+00	\N	\N	crowdfunding card.png	https://www.youtube.com/embed/uVVfzZuKzy4	user_menu_my_projects	2016-10-17 20:13:03.720687	No-Budget Science	\N	\N	\N	\N	\N	\N	\N	'budget':3A 'cabec':14B 'cientif':16B 'event':15B 'ide':12B 'laptop':7B 'mao':9B 'no-budget':1A 'nobudgetscienc':5C 'scienc':4A	\N	2016-11-25 01:59:59.999999	f	t	f
40	Devoradores de lixo: Uma alternativa proteica	147	15	90000.0	Usar lixo para produção de proteína alternativa e trazer o desenvolvimento regional é nosso sonho!	\N	\N	2017-08-09 21:10:58.046388	2017-09-12 16:58:19.229361	<p>Você sabia que até 2050 seremos cerca de 10 bilhões de habitantes no planeta, e por conta disso a demanda mundial por proteína deve dobrar? Sabia que das 2,3 bilhões de toneladas de cereais produzidos/ano,  33% são utilizadas para ração animal? Sabia que sem inovação e a produção de novas fontes proteicas o planeta corre risco de segurança alimentar e que uma indústria de produção de insetos está se configurando no mundo até 2020<span class="redactor-invisible-space">?</span></p><p>Essas informações são fornecidas pela FAO (Organização das Nações Unidas para Alimentação e Agricultura) em seu relatório "Edible Insects" (Insetos comestíveis). Embora existam algumas iniciativas, sabemos que a cultura ocidental ainda está um pouco distante de aceitar insetos para consumo humano. Mas por que não utilizá-los como componente de ração animal? Aqui na Amazônia quente e úmida temos as condições climáticas perfeitas para o cultivo de larvas de insetos como fonte alternativa de proteína! A ideia é utilizarmos lixo orgânico como alimento para larvas de Mosca Soldado. Ao final, temos o processamento do resíduo orgânico, que é totalmente degradado e transformado em biomassa de larva, rica em óleo e proteína. E como subproduto, a produção biofertilizante orgânico.<span class="redactor-invisible-space"> Países como Estados Unidos, Canadá, Holanda, África do Sul e China já desenvolveram projetos parecidos e viáveis mesmo com custos de controle climático. Por que não fazer na Amazônia? Na região, a </span>piscicultura tem crescido a taxas maiores que 100% ao ano, mesmo com  as caras fontes tradicionais de proteína, como a soja (cerca de 70% dos custos de produção). Até o Ministério da Agricultura e do Abastecimento já reconheceu o potencial do produto e já registrou a farinha de larva de mosca soldado negra como uma matéria prima possível para a fabricação de rações destinadas a PETs, suínos, aves e peixes.</p><p>Imagine o Estado do Amazonas... a área é tão grande que cabe todos os Estados do Nordeste. Dos 62 municípios do Estado cerca de 50 deles só se pode chegar por navegação pelos sinuosos rios ou por avião. A maioria deles tem densidade demográfica baixíssima, poucas fontes de receita, além do desmatamento e pesca predatória e até hoje sofrem por problemas de saneamento, já que é inviável a instalação de aterros sanitários. Buscamos também com este projeto trazer uma alternativa para o tratamento de resíduos orgânicos nestes municípios. Imagine parcerias com as prefeituras para tratar resíduos orgânicos e ainda melhorar o desenvolvimento regional com uma fonte alternativa de proteína, já que a logística complicadíssima para esses municípios encarece os produtos na ponta e faz com que a ração chegue muito cara. Uma galinha viva, por exemplo, chegue a custar mais de R$ 50,00 em algumas localidades!</p><p><span class="redactor-invisible-space">Faz pouco mais de 1 ano que iniciamos as pesquisas em parceria com a Universidade Federal do Amazonas para a produção da Mosca Soldado. Nesta ocasião foi constituída a NatuProtein, cujos sócios são o Dr. Carlos Gustavo Nunes, professor de Biotecnologia da UFAM e o gestor ambiental e mestrando em Ciências Ambientais, Nelson Poli. Atualmente estamos processando resíduos orgânicos em pequena escala (300 Kg por mês) e já validamos o processo de produção nesta escala. O principal objetivo deste crowdfunding é angariar fundos para a confecção de um protótipo de um módulo de processamento dos resíduos e engorda de larvas em container para que este possa ser destinado a feiras e locais de grande produção e recebimento de resíduos orgânicos. O projeto deverá ser desenvolvido em parceria com o Instituto SENAI de Inovação que irá propor as melhores soluções em materiais, sensores e automação. Após confeccionado, o módulo entrará em operação para ajustes dos métodos de processamento e criação. Espera-se a conclusão do projeto e validação dos métodos e da tecnologia até junho de 2018. </span></p>	f	\N	devoradoresdelixo	\N	in_analysis	60	\N	\N	\N	Imagem2.jpg	https://www.youtube.com/embed/0vU38Gjkv80	user_menu_my_projects	2017-08-27 22:01:49.804036	\N	\N	\N	\N	\N	\N	\N	\N	'altern':5A,14B 'ambient':24B 'cienc':23B 'desenvolv':18B 'devor':1A 'devoradoresdelix':7C 'lix':3A,9B 'produca':11B 'proteic':6A 'protein':13B 'regional':19B 'sonh':22B 'traz':16B 'usar':8B	\N	\N	f	f	f
