17	Combatendo o Alzheimer com medicamentos para o diabetes	18	19	85000.0	Podemos estar perto de um novo tratamento para o Alzheimer, e contamos com você para seguir adiante!	\N	\N	2016-10-18 16:41:58.719882	2017-10-05 16:30:42.779968	<p><strong></strong></p><p>English description below!<br></p><p><img src="/uploads/redactor_rails/picture/data/16/alzh.png"><br></p><p><br></p><p style="text-align: justify;">Neste momento cerca de 47,5 milhões de pessoas no mundo estão sofrendo de algum tipo de demência. Somam-se a estes números os familiares e cuidadores, que sofrem junto. Dois em cada três destes casos de demência são causados pela Doença de Alzheimer, uma doença incurável e devastadora para os pacientes e seus familiares. No Alzheimer, uma série de alterações químicas no cérebro causam pouco a pouco a perda da capacidade dos neurônios de comunicarem-se entre si. Essa comunicação é fundamental para que nosso cérebro funcione normalmente e possa exercer funções tão preciosas para nós como a memória, o raciocínio, a linguagem e as emoções. Na doença de Alzheimer, todas estas funções estão comprometidas.</p><p style="text-align: justify;"><br></p><p><img src="/uploads/redactor_rails/picture/data/160/Fig1.jpg"></p><p style="text-align: justify;"><br></p><p style="text-align: justify;">O Diabetes é uma outra doença muito presente na população mundial. No diabetes, os níveis de glicose no sangue aumentam gerando consequências graves para o organismo. Para que tecidos do corpo como músculo, gordura e fígado (chamados tecidos periféricos) absorvam a glicose do sangue, eles precisam de um sinal especial, que é dado pela insulina. O que acontece no diabetes chamado de “diabetes tipo 2” é que as células dos tecidos periféricos não “sentem” mais o sinal da insulina e por isso deixam de absorver glicose do sangue. Diz-se que estes tecidos tornaram-se “resistentes à insulina”. Felizmente, ao contrário da doença de Alzheimer, já estão disponíveis diversos medicamentos capazes de controlar o diabetes tipo 2 de maneira bastante eficiente. O que esses medicamentos fazem, basicamente, é restaurar a capacidade dos tecidos periféricos de “sentir” o sinal da insulina e responder apropriadamente a ela.<br></p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><img src="/uploads/redactor_rails/picture/data/5/Fig2.jpg"></p><p style="text-align: justify;"><br></p><p style="text-align: justify;">Muito bem. Mas o que uma coisa tem a ver com a outra?! Afinal, uma doença afeta somente o cérebro, outra afeta os tecidos periféricos... Alzheimer não tem nada a ver com diabetes, certo? ... Errado!</p><p style="text-align: justify;">Acontece que, na última década, médicos e cientistas perceberam que pacientes diabéticos tem muito mais chance de desenvolver Alzheimer do que quem não teve diabetes. Além disso, foi descoberto recentemente que neurônios também são sensíveis ao sinal da insulina e que este sinal é muito importante para o bom funcionamento do cérebro e para a formação das memórias.</p><p style="text-align: justify;">E é aí que nós entramos!</p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><img src="/uploads/redactor_rails/picture/data/59/equipe.jpg"><br></p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><img src="/uploads/redactor_rails/picture/data/12/nossa_pesquisa.png"></p><p style="text-align: justify;"><br></p><p style="text-align: justify;">Nossa equipe dos Laboratórios de Investigação da Doença de Alzheimer (LInDA) e de Doenças Neurodegenerativas (LDN) da UFRJ descobriu recentemente que toxinas que se acumulam no cérebro na doença de Alzheimer atacam os neurônios tornando-os resistentes à insulina – assim como acontece com as células periféricas no diabetes – e que isso prejudica o funcionamento cerebral. Interessante, não é mesmo?! Pois mais interessante ainda é a possibilidade que surge dessa descoberta. Talvez você mesmo já esteja se fazendo essa pergunta: será que os medicamentos que restauram a sensibilidade dos tecidos periféricos à insulina no diabetes são capazes de fazer o mesmo com os neurônios doentes do paciente com Alzheimer?! Será?</p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><img src="/uploads/redactor_rails/picture/data/6/Figura_3.jpg"><br></p><p style="text-align: justify;"><br></p><p style="text-align: justify;">Na ciência, perguntas interessantes não podem ficar sem resposta! Principalmente se a resposta a essas perguntas tiver potencial para um impacto muito positivo na vida de milhões de pessoas, como neste caso. Por isso, estamos direcionando nossos esforços para buscar esta resposta. Já começamos estas pesquisas, e os resultados são bastante animadores! Em nossos experimentos, os medicamentos antidiabéticos vêm se mostrando capazes não só de proteger os neurônios e o cérebro em modelos que imitam em laboratório o que ocorre na doença, como também são capazes de reverter quadros já instalados de perda de memória nestes modelos. Os resultados são tão promissores que até mesmo o NIH, o Instituto Nacional de Saúde dos Estados Unidos, baseado em nossas descobertas e nas de outros grupos, deu início a estudos clínicos com pacientes para avaliar a eficácia destes medicamentos antidiabéticos e da própria insulina no tratamento da doença de Alzheimer.</p><p style="text-align: justify;"><br></p><iframe style="width: 500px; height: 281px;" src="//www.youtube.com/embed/s82Q-RXgjFY" frameborder="0" allowfullscreen=""></iframe><p style="text-align: justify;"><br></p><p style="text-align: justify;">Pensar que um tratamento para o Alzheimer pode estar bem mais perto do que imaginávamos é de fato muito animador! Mas não tem nada garantido, e é por isso que as pesquisas não podem parar...</p><p style="text-align: justify;">E é aí que VOCÊ entra!</p><p style="text-align: justify;">Você pode fazer parte de tudo isso colaborando nessa campanha! Precisamos da sua ajuda para impulsionar pesquisas de ponta feitas aqui no Brasil sobre a doença de Alzheimer, compreendendo seus mecanismos e buscando novos medicamentos para tratar ou até mesmo prevenir o surgimento deste tipo de demência que traz tanto sofrimento e prejuízo para as pessoas.<br></p><p style="text-align: justify;">Além de se tornar um membro fundamental de nossa equipe de cientista contribuindo com uma causa tão nobre e ajudando a avançarmos no tratamento da doença de Alzheimer, veja o que você ainda ganhara como recompensa:</p><p style="text-align: justify;"><br></p><p style="text-align: justify;"><img src="/uploads/redactor_rails/picture/data/8/separador.png"></p><p style="text-align: justify;"><br></p><p><img src="/uploads/redactor_rails/picture/data/60/MAIL_OK.jpg" alt="" width="390" height="325" style="display: block; margin: auto; width: 390px; height: 325px;"></p><p style="text-align: justify;"><br></p><p><img src="/uploads/redactor_rails/picture/data/61/IMAGEM_ok__2_.jpg" alt="" width="398" height="332" style="display: block; margin: auto; width: 398px; height: 332px;"></p><p><img src="/uploads/redactor_rails/picture/data/62/camisa_ok.jpg" alt="" width="401" height="336" style="display: block; margin: auto; width: 401px; height: 336px;"></p><p><img src="/uploads/redactor_rails/picture/data/63/caneca_ok.jpg" alt="" width="402" height="335" style="display: block; margin: auto; width: 402px; height: 335px;"></p><p><a href="http://neuroforma.com.br"><img src="/uploads/redactor_rails/picture/data/64/250_OK.jpg" alt="" width="401" height="333" style="display: block; margin: auto; width: 401px; height: 333px;"></a></p><p><a href="http://neuroforma.com.br"><img src="/uploads/redactor_rails/picture/data/65/neuroforma_anual_ok.jpg" alt="" width="403" height="336" style="display: block; margin: auto; width: 403px; height: 336px;"></a></p><p><img src="/uploads/redactor_rails/picture/data/67/QUADRO_OK.jpg" alt="" width="402" height="336" style="display: block; margin: auto; width: 402px; height: 336px;"></p><p><img src="/uploads/redactor_rails/picture/data/68/VISITA_LAB_OK.jpg" alt="" width="402" height="335" style="display: block; margin: auto; width: 402px; height: 335px;"></p><p><img src="/uploads/redactor_rails/picture/data/69/REUNI_O_CHEFES_OK.jpg" alt="" width="401" height="335" style="display: block; margin: auto; width: 401px; height: 335px;"></p><p><br></p><p><br></p><p style="text-align: justify;"><img src="/uploads/redactor_rails/picture/data/10/OR_AMENTO.png"></p><p style="text-align: justify;"><br></p><p style="text-align: justify;">Nosso equipe já vem desenvolvendo esta linha de pesquisa a alguns anos, como podemos ver nessas reportagens:</p><p style="text-align: justify;"><a href="http://oglobo.globo.com/sociedade/saude/alzheimer-um-diabetes-que-ocorre-no-cerebro-diz-pesquisadora-da-ufrj-17486989" target="_blank">O Globo - Alzheimer é um diabetes do cérebro</a><br></p><p style="text-align: justify;"><a href="http://noticias.uol.com.br/ciencia/ultimas-noticias/redacao/2014/04/09/brasileiros-lideram-pesquisa-que-busca-causa-e-tratamento-para-alzheimer.htm" target="_blank">UOL Notícias - Brasileiros lideram pesquisa buscando causa e tratamento para o alzheimer</a><br></p><p style="text-align: justify;"><a href="http://redeglobo.globo.com/globouniversidade/noticia/2014/01/sergio-ferreira-afirma-remedios-antidiabetes-podem-tratar-alzheimer.html" target="_blank">Rede GLOBO - Remédios antidiabetes podem tratar Alzheimer</a><br></p><p style="text-align: justify;">Esse processo é muito caro, e é aí que precisamos de seu apoio. O dinheiro será utilizado para comprar reagentes, manutenção dos biotérios e dos diversos equipamentos usados na pesquisa.</p><p style="text-align: justify;"><img src="/uploads/redactor_rails/picture/data/11/meta-chart__2_.png"><br></p><p style="text-align: justify;">Muito obrigado pelo seu apoio. Fique atento à página de nosso projeto pois estaremos sempre postando atualizações sobre o andamento da pesquisa.</p><p style="text-align: justify;" rel="text-align: justify;"><strong><br></strong></p><p style="text-align: justify;" rel="text-align: justify;"><strong>APOIO:</strong><strong></strong><br></p><p><a href="http://neuroforma.com.br"><img src="/uploads/redactor_rails/picture/data/58/neuroforma2_60.png" width="351" height="351" alt="Neuroforma" style="width: 351px; height: 351px; display: block; margin: auto;"></a></p><p><br></p><p>We may be close to a new treatment against Alzheimer’s and we are counting on your help to keep moving forward!</p>    <p><strong>Alzheimer’s and diabetes</strong></p>    <p>Right now, nearly 50 million people are suffering from dementia—an emotional and financial burden shared by patients, family members and caregivers. Two out of every three cases of dementia are caused by Alzheimer’s disease, a progressive and incurable condition. Alzheimer’s patients go through a sequence of chemical alterations in their brains that gradually cause neurons to become unable to talk to one another. This communication between neurons is fundamental for normal brain function; it is the basis for some of what is most precious to us: our memories, our reasoning, language, and emotions. Slowly but surely, Alzheimer’s disease takes them all away.</p>  <p>Diabetes is another disease that is highly prevalent in the world population. In diabetes, blood glucose levels are increased, causing grave consequences for the body. In order for tissues such as our muscles, fat and liver (peripheral tissues) to absorb blood glucose, they need a special signal, that is given by the hormone insulin. What happens in type 2 diabetes for instance, is that cells in peripheral tissues no longer ‘feel’ the insulin signal, and therefore no longer absorb glucose from the blood. When a cell behaves in this way we say that it has become ‘insulin resistant’. Thankfully, unlike Alzheimer’s, diabetes already has numerous effective medications available, which help patients keep it in check. What these medications do, basically, is to restore the tissues’ capacity to ‘feel’ the insulin signal and respond to it appropriately.</p>  <p>Alright. But what does one thing have to do with the other?! After all, one is a disease of the brain, the other affects peripheral tissues… Alzheimer’s has nothing to do with diabetes, right? ...Wrong! </p>  <p>The fact is that, in the last decade, physicians and scientists have found that diabetic patients have a much higher chance of developing Alzheimer than do patients who never had diabetes. Besides, it was recently found that neurons are also sensitive to insulin, and that its signal is really important for the normal functioning of the brain, including memory formation.</p>  <p>And that’s where we come in!</p>    <p><strong>Our research</strong></p>    <p>Our team, split into two laboratories focused on Alzheimer’s disease (LInDA and LDN, in their Portuguese acronyms), at the Federal University of Rio de Janeiro (UFRJ), recently found that toxins that accumulate in the Alzheimer’s brain attack neurons and make them insulin resistant—just like peripheral cells in diabetes—and that impairs brain function. Interesting, isn’t it?! But even more interesting is the possibility that stems from that discovery. Perhaps you are already asking yourself this question: Are medications that restore insulin sensitivity to peripheral tissues also capable of doing the same to the impaired neurons of Alzheimer’s patients?</p>  <p>In Science, interesting questions must not be left unanswered! Especially if the answer to these questions has the potential to positively impact the lives of millions of people, as it does in this case. Because of that, we are focused on finding that answer. We have already started on this research, and the results are quite encouraging! In our experiments, antidiabetic medications not only have been able to protect neurons in models that mimic what happens in Alzheimer’s, but have also reverted memory loss in these same models. These results are so promising that the National Institutes of Health (NIH-USA), based on our discoveries and those of other groups, have begun clinical trials to test the efficacy of these antidiabetic medications and of insulin itself in treating Alzheimer’s.</p>  <p>To think that a treatment for Alzheimer’s may be much closer than we imagined is very encouraging indeed! But we can’t take anything for granted—that is why research must go on…</p>    <p><strong>And that is where YOU come in!</strong></p>  <p><strong> </strong></p>  <p>You can be part of all this by collaborating with this campaign! We need your help to boost this cutting-edge Alzheimer’s research, to understand its mechanisms and find new medications to treat or prevent this painful and costly disease.</p>  <p>In addition to becoming an important member of our research team and contributing to the noble cause of fighting Alzheimer’s, we have some additional rewards for you:</p>    <p><strong>Rewards</strong></p>  <p><strong> </strong></p>  <p>30,00 BRL (approx. 10 USD) – A Thank You email!</p>  <p>50,00 BRL (approx. 15 USD) – A high-resolution image of a neuron captured during our experiments!</p>  <p>120,00 BRL (approx. 40 USD) – Campaign T-shirt (and previous rewards) OR Campaign mug (and previous rewards)</p>  <p>250,00 BRL (approx. 80 USD) – Campaign T-shirt AND mug + cognitive training (1-month plan) by the <i>Neuroforma</i> team</p>  <p>400,00 BRL (approx. 130 USD) – Cognitive training (1-year plan) by the <i>Neuroforma</i> team</p>  <p>700,00 BRL (approx. 220 USD) – 3.28 ft. x 2.46 ft. framed image of neurons captured during our experiments!</p>  <p>1000,00 BRL (approx. 320 USD) – Guided visit to the UFRJ research Labs and lecture!</p>  <p>5000,00 BRL (approx. 1600 USD) – Meeting with the Principal Investigators of our Labs!</p>    <p><strong>How will the money be used?</strong></p>  <p><strong> </strong></p>  <p>Our team has already been working on this line of research for a few years, as you can see in the media articles below:</p>  <p><a href="http://oglobo.globo.com/sociedade/saude/alzheimer-um-diabetes-que-ocorre-no-cerebro-diz-pesquisadora-da-ufrj-17486989" target="_blank">O Globo - Alzheimer é um diabetes do cérebro</a> <i>(‘Alzheimer’s is diabetes of the brain’)</i></p>  <p><a href="http://noticias.uol.com.br/ciencia/ultimas-noticias/redacao/2014/04/09/brasileiros-lideram-pesquisa-que-busca-causa-e-tratamento-para-alzheimer.htm" target="_blank">UOL Notícias - Brasileiros lideram pesquisa buscando causa e tratamento para o alzheimer</a><i>(‘Brazilian scientists lead research project seeking the cause and cure for Alzheimer’s’)</i></p>  <p><a href="http://redeglobo.globo.com/globouniversidade/noticia/2014/01/sergio-ferreira-afirma-remedios-antidiabetes-podem-tratar-alzheimer.html" target="_blank">Rede GLOBO - Remédios antidiabetes podem tratar Alzheimer</a><i> (‘Antidiabetic medications may treat Alzheimer’s’)</i></p>  <p>Neuroscience is expensive, and we need your help. Contributions will be used to buy reagents and to maintain the animal facilities and all the equipment we use.</p>  <p>Thank you so much for your support. We will be posting regular updates on the status of our research right here on this page.</p><br>	t	\N	combatendoalzheimer	\N	online	60	2017-10-05 16:30:42.768749+00	\N	\N	Cover Notepad 512x400px.jpg	https://www.youtube.com/embed/01zI7MTYOko	user_menu_my_projects	2017-10-03 03:37:30.866435	Marcelo Vieira	\N	\N	\N	\N	\N	\N	\N	'adiant':26B 'alzheim':3A,19B 'cienc':27B 'combat':1A 'combatendoalzheim':9C 'cont':21B 'diabet':8A 'estar':11B 'medic':5A,28B 'nov':15B 'pert':12B 'pod':10B 'segu':25B 'tratament':16B 'voc':23B	\N	2017-12-05 01:59:59	f	f	f
35	CianoControl - Recuperando Lagoas	140	2	60000.0	Desenvolvendo um novo método barato e rápido para recuperação de corpos d´água. 	\N	\N	2017-07-17 18:20:49.961934	2017-11-21 15:49:50.988726	<p>O despejo de esgotos não tratados (domésticos e industriais), bem como a entrada de rejeitos de fertilizantes utilizados na agricultura em rios e lagos geram um problema ambiental chamado <strong>eutrofização artificial</strong>. Esse processo é caracterizado pelo aumento de nutrientes na água (principalmente nitrogênio e fósforo) que são fontes de alimento para algas microscópicas, conhecidas como fitoplâncton. O grupo de algas que mais se benificia com o aumento de nutrientes nos corpos d’água é o das cianobactérias. </p><p>As cianobactérias podem crescer exageradamente, formando florações que se acumulam na superfície e margens de corpos d’água podendo deixar as águas esverdeadas. As florações diminuem a qualidade da água, dando uma aspecto túrbido e odor desagradável nas águas, além da falta de oxigênio durante a noite, que pode levar a mortandades de peixes. Muitas espécies de cianobactérias produzem toxinas, chamadas cianotoxinas, que causam intoxicações em seres humanos e animais. Essas intoxicações podem causar  desde dermatites até ter efeitos  fatais, atingindo o fígado e os sistemas digestivo e nervoso. Isso representa a principal ameaça ao uso de lagos e reservatórios como fonte de abastecimento de água para consumo humano, irrigação, pesca e recreação. </p><p>Para reverter o processo de eutrofização, é essencial o controle da entrada de nutrientes, principalmente o fósforo, que chegam nos corpos d’água atravéz dos esgotos não-tratados. Porém, mesmo que os efluentes sejam tratados, em muitos casos, a melhoria da qualidade da água do lago (lagoa) só alcançada após décadas. Isso ocorre devido ao estoque desse nutriente  criado no fundo do lago, após anos de despejo de esgotos, que pode servir como fonte alimento para as cianobactérias.</p><p>Algumas técnicas tem sido utilizadas no combate à eutrofização, como o uso de sais metálicos e dragagem do sedimento. Porém, essas técnicas costumam ter um alto custo, especialmente a dragagem, e podem causar impactos ao ambiente. Uma alternativa a essas técnicas é o uso de compostos sólidos que são capazes de se ligar ao fósforo fazendo com que esse não fique mais disponível para o crescimento de cianobactérias. Esses compostos são geralmente argilas, que podem ser modificadas quimicamente ou não, e sua aplicação é mais barata quando comparada à tecnicas tradicionais. </p><p>Pensando nesse problema, um grupo de pesquisadores holandeses criaram uma técnica chamada <i>“Flock & Lock”</i> que consiste na aplicação combinada de uma baixa dose de coagulante com uma argila modificada. O coagulante, funciona agregando as células de cianobactérias, formando flocos enquanto a argila age como um peso, fazendo com que esses flocos afundem e sejam aprisionados no sedimento. Com isso, a floração de cianobactérias é removida da coluna d’água, tornando o lago mais transparente.</p><p><img src="/uploads/redactor_rails/picture/data/151/1.jpg" style="display: block; margin: auto;" alt=""><br></p><p>Técnica “Flock & Lock”</p><p>A técnica <i>“Flock & Lock”</i> apresentou resultados promissores em lagos holandeses e, a partir disso, nosso grupo de pesquisa, em parceria com a Universidadede Wageningen (Holanda) procura testar e adaptar essa técnica aos nossos sistemas aquáticos e à nossa realidade. </p><p>Para este estudo escolhemos a Lagoa de Jacarepaguá, localizada na zona oeste da cidade do Rio de Janeiro. Os principais rios que desembocam na lagoa cortam grande parte dos bairros de Jacarepaguá e adjacências, trazendo, em suas águas, grande quantidade de sedimentos, além de resíduos industriais e esgotos domésticos. Florações freqüentes de cianobactérias vêm sendo registradas desde a década de 1990, inclusive tendo sido registrados a ocorrência de espécies produtoras de cianotoxinas e o acúmulo dessas toxinas na cadeia trófica e peixes. Além da intensa urbanização ao redor da lagoa,  ainda há uma colônia de pescadores usam a pesca como fonte de renda. Desse modo, é de grande importância a melhoria da qualidade da água da lagoa de Jacarepaguá.</p><p><img src="/uploads/redactor_rails/picture/data/155/2.jpg"><br></p><p>Nós, do Laboratório de Ecologia e Fisiologia do Fitoplâncton - LabAlgas, da Universidade do Estado do Rio de Janeiro (UERJ), conscientes do problema sócio-ambiental e econômico gerado pela degradação da qualidade da água da lagoa de Jacarepaguá, buscamos alternativas para a sua restauração ambiental. Com isso, procuramos testar técnicas que sejam de fácil aplicação, baixo custo e duradouras. Com a cooperação com outros gupos de pesquisa (Laboratório de Ficologia – UFRJ e Universidade de Wagenigen – Holanda) realizamos testes em laboratório e nossos resultados mostraram que a aplicação da técnica <i>“Flock & Lock”</i>, usando materiais brasileiros de baixo custo (como solo vermelho e argilas) pode ser promissora para a remoção de cianobactérias da lagoa. </p><p>        Agora, são necessários testes em escalas maiores, utilizando unidades experimentais dentro do próprio lago. Essas unidades, chamadas de <strong>mesocosmos</strong>, são estruturas que isolam uma pequena parte do lago, mantendo as características da água dentro de sua área próximas às condições naturais da lagoa. Com essas unidades experimentais, podemos aplicar os compostos a serem testados sem comprometer o sistema inteiro, e avaliar os os efeitos diretamente na lagoa.<br></p><p><img src="/uploads/redactor_rails/picture/data/156/3.jpg"><br></p><p>Fonte: Miranda, 2017<br></p><p>Esperamos, com os resultados das nossas pesquisas, gerar um conjunto de técnicas de custo relativamente baixo, fácil aplicação e resposta rápida para o controle de florações de cianobactérias, que possa ser aplicado para recuparação ambiental de lagos e lagoas no Brasil.</p><p>O LabAlgas, desde de 2004, faz pesquisas sobre microalgas. Há 3 anos se aventurou na área de “resolver problemas”. Sob a Coordenação do professor Marcelo MANZI Marinho, alunos de pós-graduação e graduação vêm se dedicando para, não só entender como uma floração de cianobactérias acontece, como também testar materiais e aplicações que possam combatê-la. Hoje no laboratório, temos 3 pesquisadores, 3 alunos de Doutorado, 4 de Mestrado, 4 estudantes de Iniciação Científica e 2 estudantes de Iniciação Científica Júnior (Ensino Médio).</p><p><img src="/uploads/redactor_rails/picture/data/157/4.jpg"></p><p>Você também pode participar deste projeto! </p><p><strong>Por que sua doação é importante?</strong></p><p>Através do seu apoio financeiro poderemos custear os gastos com esta pesquisa.</p><p>As maiores despesas do projeto estão relacionadas à compra de materiais e os custos da montagem das estruturas em alumínio para confecção dos mesocosmos. Junto com reagentes químicos e outros materiais a serem utilizados nas análises em laboratório, estas despesas representam cerca de 62% do custo do projeto. O orçamento prevê ainda a aquisição de um coletor de sedimento, equipamento indispensável para coletar amostras no fundo dos mesocosmos e verificar a eficácia da técnica que estamos testando. Além disso, também estão previstos no orçamento, os custos administrativos e despesas com o trabalho de campo (combustível, transporte das estruturas) </p><p><img src="/uploads/redactor_rails/picture/data/163/orc.jpg"></p><p>Mesmo que não possa neste momento contribuir financeiramente, nos ajude compartilhando com seus amigos.</p><p>Já deixamos o nosso muito obrigado e estamos à disposição para conversarmos sobre o projeto e outros problemas relacionados à qualidade das águas.</p><p><br></p><p><br></p>	t	\N	cianocontrol	\N	draft	120	2017-11-21 15:35:35.276991+00	\N	\N	capa campanha site.png	https://www.youtube.com/embed/NsEHaFNeXRo	home_recommended	2017-11-21 15:35:13.000385	Marcelo Manzi	\N	\N	\N	2017-11-21 15:49:50.98407	\N	\N	\N