27	Nova terapia para o câncer de mama	124	18	\N	Apoie a ciência brasileira a estudar o câncer de mama.	\N	\N	2017-04-19 12:43:07.561734	2017-05-18 14:20:05.026956	<p>E se você pudesse contribuir para o descobrimento de uma nova quimioterapia para o câncer de mama?</p>  <p> É exatamente isso que nós do Laboratório de Compostos com Atividade Biológica estamos tentando fazer com o seu apoio!</p>  <p><img src="/uploads/redactor_rails/picture/data/71/microscope-275984.jpg"></p><p>Em 2016, estima-se que 57.960 novos casos de câncer de mama surgiram no Brasil. Hoje já existem muitos medicamentos utilizados como quimioterápicos para as diferentes fases da doença. Em geral, os medicamentos que atacam as células do câncer afetam também as células sadias do corpo. Por isso, esses pacientes acabam sofrendo efeitos colaterais como infecções na boca, alterações sanguíneas e também náuseas, vômitos, diarreia e queda de cabelo.</p>  <p><img src="/uploads/redactor_rails/picture/data/70/cancer-cells-541954_1920.jpg"></p><p>Um destes medicamentos, o melfalan, é bastante eficiente no combate às células cancerosas. Porém, causa tantos efeitos colaterais que acaba sendo usado apenas quando outras substâncias já não fazem mais efeito, em estágios finais da doença. Portanto, o ideal seria poder usar o melfalan contra o câncer sem causar tantos danos às células saudáveis do corpo.</p>  <p>Será que isso é possível se usarmos o melfalan em conjunto com outra substância anticancer? </p>  <p>Essa é a pergunta que queremos responder com a sua contribuição para este projeto! Sabemos da existência de  alimentos que contém compostos com ação contra alguns tipos de câncer. Dentre estes, estão as uvas que possuem um antioxidante com potencial anticancer conhecido como resveratrol. Nosso objetivo é estudar os efeitos do melfalan quando utilizado junto ao resveratrol em células de câncer de mama de humanos.</p>  <p><img src="/uploads/redactor_rails/picture/data/73/como_sera_utilizado.jpg"></p><p>Etapas do projeto:</p>  <ul><li>1) Vamos utilizar células de câncer de mama humano tratadas com melfalan e com diferentes quantidades de resveratrol. Também trataremos células normais da mama para saber se essa mistura pode causar morte de células sadias;</li><li>2) Vários testes diferentes serão realizados para avaliar se realmente houve morte celular;</li><li>3) Depois de determinar as quantidades ideais para matar somente células cancerosas, faremos testes para descobrir por qual via bioquímica a morte celular aconteceu. É nesta fase que utilizaremos os recursos adquiridos por meio dessa campanha para a compra de anticorpos, cada um custa em torno de R$ 1.000,00;</li><li>4) Analisaremos também diferentes rotas metabólicas para conhecer como exatamente o melfalan e o resveratol agem dentro das células.  </li></ul>        <p><img src="/uploads/redactor_rails/picture/data/72/cells-1872666_1920.jpg"></p><p>A realização deste estudo é a primeira etapa para a descoberta de novas terapias para o câncer de mama. Os resultados deste projeto poderão fornecer informações importantes para que pesquisas com animais de laboratório e depois com humanos possam ser realizadas.  Por fim, uma nova possibilidade para a terapia do câncer de mama poderá ser estudada. Mas para que tudo isso possa acontecer, precisamos da sua colaboração.</p>  <p>Seja parte deste projeto, faça a ciência acontecer!</p>	f	\N	deleted_project_27	\N	deleted	\N	\N	\N	\N	facebook.jpg	\N	home_recommended	\N	\N	\N	\N	\N	\N	\N	\N	\N	'27':10C 'apoi':11B 'bioquim':21B 'brasileir':14B 'canc':5A,18B 'cienc':13B 'deleted':8C 'estud':16B 'mam':7A,20B 'nov':1A 'project':9C 'terap':2A	\N	\N	f	t	f
25	Darwinismo Universal: ingredientes para uma Biologia Universal	97	11	12000.0	Se existir vida n´outro lugar, sua evolução obedeceria à Seleção Natural? É o Darwinismo, Universal?	\N	\N	2016-12-06 18:38:08.664426	2017-01-16 00:03:04.218187	<blockquote class="fontsize-base quote" style="text-align: center;"></blockquote><blockquote class="fontsize-base quote" style="text-align: center;"><i><strong><em>Apadrina un joven científico esta Navidad para que tenga futuro. </em><em>Ayudadnos a completar el objetivo ☛<br> <em>¡Allá vamos, @</em><em>Charles R. Darwin</em><em>!</em><span class="redactor-invisible-space"></span></em><br></strong></i><i><strong></strong></i></blockquote><p><i><strong><img src="https://entropiacoletiva.com/uploads/redactor_rails/picture/data/54/Darwinismo_Universal.jpg"></strong></i></p><blockquote class="fontsize-base quote" style="text-align: center;">Astrobiologia é uma área de pesquisa que procura formas de vida ou ambientes propícios à vida em corpos celestes, sejam planetas, luas, meteoros, estrelas e etc... <strong>Mas se supusemos que exista vida, em outros planetas ou luas, por exemplo, como terá sido sua evolução? </strong>Será que a evolução da vida, mesmo fora da Terra, também obedeceria à Teoria da Seleção Natural de Charles Darwin? Seria o Darwinismo “universal”?</blockquote><p>O<em></em>s estudos de Darwin influenciam muito das buscas por vida, uma vez que as definições mais gerais de vida estariam fundamentadas em tudo àquilo que passaria por um <em>processo de seleção natural.</em> Portanto, “<strong>se existe vida fora da Terra, conseguiríamos detectá-la utilizando ferramentas baseadas no Darwinismo Universal</strong>?”. Caso exista outra vida seriam iguais, semelhantes ou radicalmente diferentes? Deriva daí a busca de uma “<strong>biologia universal</strong>”, no sentido de construir definições válidas aqui e em qualquer lugar que não falhem na detecção, isto é, caso exista vida em outros planetas seríamos capazes de detectá-la com as ferramentas que dispomos? Caso não o que falta para complementarmos?<br></p><blockquote class="fontsize-base quote"><em>Para essa viagem é que <strong>gostaria de convidá-los a participar</strong>, colaborando com esse trabalho, que poderá trazer resultados com implicações não só quanto à biologia e a (s) ciência (s), mas também quanto a questões filosóficas sobre nosso papel no Universo. <strong>Esse desafio só será possível com sua participação</strong>.<br><br></em></blockquote><p><span></span></p><hr><blockquote rel="text-align: center;" class="fontsize-base quote" style="text-align: center;">Alguns brindes:<br>Como diria o autor, "<strong>Não é sempre que uma personagem comparece ao lançamento de um livro</strong>". <br>Seja a 18° estrela mais brilhante da Constelação de Escorpião e brilhem como padrinho DIAMANTE.</blockquote><p class="fontsize-base quote" style="text-align: center;" rel="text-align: center;">Não vou revelar que vários personagens da astrobiologia e situações reais foram parar dentro do livro. <strong>Quando a ficção se confunde com a realidade, difícil saber qual a verdadeira</strong>. </p><p><img src="https://entropiacoletiva.com/uploads/redactor_rails/picture/data/55/Livro_Lan_amento.jpg"></p><blockquote class="fontsize-base quote" style="text-align: center;"><em><strong>Um brinde de "Impacto"</strong><br>Padrinho MARFIM ganha um <strong>meteorito</strong>!! <br>São limitados (antes que o laboratório de astrobiologia me mate..corre!!)<br></em></blockquote><p style="text-align: center;"><img src="/uploads/redactor_rails/picture/data/42/Artist_s_conception_of_view_from_surface_of_Europa__NASA_JPL-Caltech_.jpg" alt="" style="display: block; margin: auto;">Concepção artística da lua Europa (NASA/JPL-Caltech)</p><blockquote class="fontsize-base quote">Ao propor quais os "ingredientes universais" faltariam para caminharmos a um padrão de vida mais geral, <strong>a própria Terra é nosso laboratório</strong>: <em>sistemas biológicos radicalmente diferentes poderiam seguir, ao menos em parte, os mesmos caminhos evolutivos</em> se considerarmos que as propriedades físico-químicas de <strong>auto-organização</strong> e <strong>autonomia</strong> se repetiriam em qualquer lugar do Universo. Assim, parte dessa busca “não está lá fora”: para entender questões astrobiológicas fundamentais, portanto, devemos entender antes a origem, a evolução e a diversificação da vida na própria Terra.</blockquote><p>Nesse contexto, faz-se necessário estabelecer <strong>o que se entende por uma biologia universal</strong>, uma vez que todas as formas de organização viva conhecidas são terrestres, é apropriado questionar sobre a universalidade da biologia como um objeto de pesquisa válido. A melhor maneira de testar a hipótese da emergência múltipla da vida é adotar a estratégia de <em>criar nossos próprios sistemas</em> e ver até onde chegamos: a biologia sintética poderia mostrar as raízes as quais um sistema começaria ter comportamento biológico.<br></p><p>Esta pesquisa, portanto, propõe um estudo à luz das abordagens da biologia sintética (modelos protocelulares de origem da vida) para iluminar a relação entre <strong>estruturas organizativas</strong> e <strong>concepções evolutivas</strong>.</p><p><img src="/uploads/redactor_rails/picture/data/33/Ben_2.jpg"></p><p style="text-align: center;">Tese doutoral de Ben-Shirt defendida fevereiro de 2016 (doutorando de Ruiz-Mirazó).</p><p>A partir daí, tentaremos estabelecer algumas das bases conceituais sobre as quais fosse possível construir uma teoria biológica geral. Com esse propósito, trabalharemos com a hipótese de que o estudo de <em>modelos mínimos</em> (nesse caso, protocelulares) e seus <em>constraints</em> (restrições) ecológicos são adequados para extrair conclusões de caráter geral sobre as ambas as dimensões. A <strong>protocélula</strong>, <em>sistemas celulares mínimos capazes de auto replicar-se</em>, é a nossa proposta como ponte de conexão, pois a fim de entender como evolui a vida, devemos antes entender as bases organizativas nas quais ela se desenvolve e diversifica. <br></p><blockquote class="fontsize-base quote">Fundamentalmente, perguntaríamos: como se dá a integração funcional de um sistema individual a dimensão coletiva (histórica)?</blockquote><p><img src="/uploads/redactor_rails/picture/data/30/bottom_up.png" width="476" height="366" alt="" style="width: 476px; height: 366px; display: block; margin: auto;"></p><p style="text-align: center;"><img src="/uploads/redactor_rails/picture/data/43/prometabolismo.jpg" width="439" height="321" style="width: 439px; height: 321px;"><br></p><p>Uma perspectiva que aborde a <strong>organização biológica</strong> e a <strong>evolução</strong> de forma conjunta pode ser capaz de oferecer uma visão mais completa e coerente do organismo, a partir daí justifica-se o projeto no intuito de iniciar um processo de <strong>reabilitar o ideal de universalidade</strong> biológica. </p><hr><p><strong>Implicações bioassinaturas</strong></p><p>Conforme mencionado sobre a importância de estudar condições ambientais de outros planetas fica a pergunta: como fazemos estas buscas? Utilizando sondas planetárias, como os <em>rovers</em> atualmente presentes em Marte, e os futuramente planejados (ExoMars), é possível realizar experimentos de espectroscopia <em>in situ</em>, a fim de obter informações de composição química. Essa é uma das maneiras de, possivelmente, detectar moléculas que possam ser relacionadas à presença de vida atual ou fóssil. Essas moléculas de vida são conhecidas como <strong>bioassinaturas</strong>: <em>quaisquer atributos químicos, físicos ou fisiológicos cujo padrão requer a ação de um agente biológico</em>. Micro-organismos extremófilos terrestres --presentes em ambientes inóspitos, do fundo dos mares à estratosfera --- e os subprodutos de seu metabolismo são os modelos utilizados nessa busca.</p><p><img src="/uploads/redactor_rails/picture/data/39/europa-lakes.jpg"><br></p><p>Europa's "Great Lake." Scientists speculate many more exist throughout the shallow regions of the moon's icy shell. <cite>Credit: Britney Schmidt/Dead Pixel VFX/Univ. of Texas at Austin</cite></p><p>Desse modo, a busca de bioassinaturas só tem sentido ao conectar <strong>ingredientes organizativos e evolutivos</strong> em conjunto, e assim, explicar a ordem biológica onde quer que exista. O Darwinismo é nosso ponto de partida como uma ferramenta poderosa que aponta ao ideal de universalidade que buscamos. Mas ainda falta muito para complementá-lo...assim..<br></p><p class="fontsize-base quote" style="text-align: center;"><em>Como Darwin <em><em>termina sua grande obra </em></em>é onde começa a nossa, embarque nas <strong>infinitas formas de grande </strong>beleza conosco: <br></em><br>«There is a grandeur in this view of life, with its several powers, having been originally breathed into a few forms or into one; and that whilst this planet has gone cycling on according to the fixed law of gravity, from so simple a beginning endless forms most beautiful and most wonderful have been, and are being, evolved.» <em>A Origem das Espécies, 1859.</em><img src="https://entropiacoletiva.com/uploads/redactor_rails/picture/data/38/Esquema_Geral_3.png"></p><p><strong>Créditos imagem: Robson Aleixo. Cientista da Computação - USP.</strong></p><p>O que nós esperamos é que essa relação nos dê pistas acerca da evolução da vida no universo, se essa evolução seguiria alguns processos e padrões evolutivos ocorridos e que continuam ocorrer na Terra. Em outras palavras, que nos dê pistas sobre como caminharemos a uma Teoria mais geral da Biologia e com isso descobrir o que se entende por “lei” em biologia uma vez que a característica que distingue os sistemas vivos dos não vivos é sua historicidade. Assim, a despeito da historicidade da vida (vide pôster abaixo) nos questionamos <strong>quais padrões se repetiriam aqui ou em outro lugar do Universo</strong>.<br></p><hr><blockquote class="fontsize-base quote">Espero por suas perguntas e opiniões sobre a pesquisa, e será um imenso prazer debatermos e trocarmos opiniões. <br>Colabore com a Ciência. Unindo continentes é a prova maior que todos podemos ser <a href="https://www.academia.edu/4522747/Todo_bi%C3%B3logo_%C3%A9_um_pouco_astrobi%C3%B3logo">um pouco Astrobiólogos</a>.</blockquote><hr><p><span></span><strong>Etapas do Trabalho</strong><br></p><p>A primeira etapa do trabalho consiste em entender os tipos de explicação científica: históricas, nomológicas e mecanicistas. Convidamos a abrir a porta do desconhecido com nosso primeiro pôster e entender que modelos Darwin construiu para responder quais tipos de perguntas  e que modelos queremos construir para resolver quais novas perguntas.</p><p><a href="https://www.entropiacoletiva.com/images/life_origins.png" target="_blank"><img src="/uploads/redactor_rails/picture/data/31/Poster_Alabi_Ruiz-Mirazo.png" alt="Poster Cortesia Click para ampliar" style="display: block; margin: auto;"></a></p><p><br></p><p>Isso supõe entender os tipos de explicação em ciência, neste caso, o objetivo desta etapa é entender o que é a <em>historicidade </em>da vida frente sua universalidade e como entrelaçamos narrativas e leis em biologia que nos permitam caminhar a um <strong>Darwinismo Estendido</strong> no qual sem falar em ‘leis’ a biologia teria certo caráter nômico e generalizações restringidas.</p><p><br></p><p><img src="/uploads/redactor_rails/picture/data/34/Kepa_quimica_sistemas.jpg"></p><p style="text-align: center;"><strong>Esquema geral</strong>: desde as moléculas até os sistemas. A complexidade química daria lugar biomoléculas em um meio heterogêneo, quem sabe como previa Darwin "en un charco de água temblada".</p><p style="text-align: center;">Mais informações: <u>Artigo científico: </u>“<a href="http://dx.doi.org/10.1021/cr2004844">Prebiotic Systems Chemistry: New Perspectives for the Origins of Life</a>“, Kepa Ruiz-Mirazo, Carlos Briones e Andrés de la Escosura. Chemical Reviews 2014, 114, 285-366. DOI: 10.1021/cr2004844</p><p><br></p><hr><p>Para esta 1ª etapa nossos valores todos públicos são referentes às <strong>taxas de renovação de matricula</strong> e podem ser acessadas no <a href="http://www.ehu.eus/es/web/estudiosdeposgrado-graduondokoikasketak/masterren-prezioen-taula" target="_blank">site da Universidade</a>. Estamos no 2º ano, a tabela referente esta na 2ª coluna multiplicado por 15 créditos. </p><p style="text-align: center;"><strong>Total = 2.361,62 €</strong></p><p style="text-align: center;"><strong>Total com câmbios variáveis +  taxas da plataforma =2.500€</strong></p><hr><p><em></em></p><blockquote class="fontsize-base quote"></blockquote><blockquote class="fontsize-base quote"></blockquote><p><em>Apadrina un joven científico esta Navidad para que tenga futuro. </em><em>No te olvides de ayudarnos a difundir esta campaña en redes sociales para que podamos alcanzar el objetivo y llegar a mucha más gente.</em></p><blockquote class="fontsize-base quote" style="text-align: center;" rel="text-align: center;"><em></em><em></em><em>Pagina FB: 👍 </em><a href="https://www.facebook.com/darwinismouniversal" target="_blank">Levando Darwin aos Extremos</a></blockquote><p style="text-align: center;">Quedan apenas ■■□□□□<span class="redactor-invisible-space"></span> % para que la campaña Darwinismo sea realidad.<span class="redactor-invisible-space"></span></p><blockquote class="fontsize-base quote" style="text-align: center;" rel="text-align: center;">Ayudadnos a completar el objetivo.<br><span class="redactor-invisible-space">¡Allá vamos, @<strong>Charles R. Darwin</strong>!</span></blockquote><blockquote class="fontsize-base quote"></blockquote><blockquote class="fontsize-base quote"></blockquote><span class="redactor-invisible-space"><span class="redactor-invisible-space"></span></span><p><a href="https://www.facebook.com/darwinismouniversal" target="_blank"><img src="/uploads/redactor_rails/picture/data/52/Capa_Darwin_em_Marte.JPG" alt="Créditos: Alabi, L.P." style="display: block; margin: auto;"></a>Créditos: Alabi, L.P.</p><p><br></p>	\N	\N	darwinismouniversal	\N	online	30	2016-12-08 00:30:02.752532+00	\N	\N	Darwinismo Universal.jpg	https://www.youtube.com/embed/RdvGejqyBvg	user_menu_my_projects	2016-12-07 23:07:10.512676	Letícia Paola Alabí	\N	\N	\N	2016-12-07 23:05:39.952563	\N	\N	\N	'biolog':6A,25B 'darwin':1A,23B 'darwinismouniversal':8C 'evoluca':16B 'exist':10B 'ingredient':3A 'lug':14B 'n':12B 'natural':20B 'obedec':17B 'outr':13B 'seleca':19B 'universal':2A,7A,24B 'vid':11B	\N	2017-01-07 01:59:59	f	t	t
