39	BIBLIOTECA CLÁSSICA	145	35	10000.0	Contribua para a produção editorial de estudos da filosofia clássica!	\N	\N	2017-08-03 18:23:11.074396	2017-09-05 18:52:20.321051	<p>A \r\nBIBLIOTECA CLÁSSICA é um projeto de apoio à produção editorial do \r\nLaboratório OUSIA de Estudos em Filosofia Clássica. Nosso objetivo é \r\ntrazer à comunidade de língua portuguesa questões de filosofia a partir \r\nde edições, traduções, comentários e discussões de textos clássicos.</p><p>Nosso projeto de crowdfounding visa ao mesmo tempo possibilitar a \r\nprodução de livros de filosofia clássica bem como distribui-los de \r\nmaneira ágil ao maior número de interessados.</p><p>Ao apoiar financeiramente o projeto você está cobrindo os custos \r\neditoriais de livros que receberá em casa entre outras recompensas. É \r\ncomo se você estivesse comprando o livro por antecipação, e assim \r\npermitindo que ele efetivamente seja produzido.</p><p>A campanha começa com a pré-venda do livro <em>PATHOS: A poética das \r\nEmoções</em>. Trata-se de uma coletânea internacional montada a partir de \r\nconferências realizadas no Simpósio Internacional OUSIA de 2008. O tema é\r\n a discussão antiga sobre a produção das emoções em obras poéticas, tais\r\n como na comédia e na tragédia, entre outras. São textos em português, \r\noriginais ou traduzidos, de Barbara Cassin, Catherine Collobert, David \r\nKonstan, Elizabeth Belfiore, Fernando Muniz , Fernando Santoro, Giovanni\r\n Casertano, Izabela Bocayuva, Malcolm Heath, Miriam Campolino, Pierre \r\nDestrée, Stephen Halliwell, Steve Leighton, Tatiana Ribeiro.</p><p><img src="/uploads/redactor_rails/picture/data/135/catalogo.png"></p><p>Contamos com seu apoio para que esse livro e muitos outros venham à \r\nluz e preencham de clássicos a sua biblioteca e a de muitos mais. A sua \r\ngenerosa colaboração garantirá que esse projeto tenha continuidade e \r\nautonomia e que a nossa cultura prospere mesmo em condições adversas. \r\nNós, autores, tradutores, filósofos, poetas, amantes da cultura \r\nclássica, agradecemos e devolveremos nossa gratidão com nossas mais \r\nbelas palavras!</p><p><img src="/uploads/redactor_rails/picture/data/134/gr_fico.png"></p>	f	\N	bibliotecaclassica	\N	approved	60	\N	\N	\N	books_old_books_school_honor-1494433222-1484.jpg	https://www.youtube.com/embed/UGDlQ5l6_xQ	\N	2017-09-05 18:52:20.317164	\N	\N	\N	\N	\N	\N	\N	\N	'bibliotec':1A 'bibliotecaclass':3C 'classic':2A,13B 'contribu':4B 'editorial':8B 'estud':10B 'filosof':12B,14B 'produca':7B	\N	\N	f	f	f
37	Experiências Tropicais de Angústia	143	24	9000.0	Publicação do livro Experiências Tropicais de Angústia	\N	\N	2017-07-19 20:40:41.92737	2017-10-18 15:31:42.862618	<p style="text-align: center;">Publicação do livro Experiências Tropicais de Angústia<br></p><p style="text-align: center;">Natália Fontes Rodrigues</p><p>Esta campanha é para arrecadar fundos para a realização de um sonho: a publicação do livro Experiências Tropicais de Angústia. Esse livro foi resultado da minha pesquisa de Mestrado. Como muitas outras pesquisas, essa nascia de uma forte vontade de compreender uma matéria que há algum tempo me interessava. Ter sido apresentada à obra de Graciliano Ramos ainda jovem me causou vívida comoção, ainda que também admirasse outros novos textos por mim conhecidos na época. Nunca antes havia me deparado com uma narrativa tão audaciosa como a das tormentas do romance Angústia do escritor alagoano. O mundo de Angústia pareceu-me demasiado grande e senti necessidade de desbravá-lo.</p><p><img src="/uploads/redactor_rails/picture/data/116/imagens_capa.png" width="598" height="217" style="width: 598px; height: 217px;"></p><p>Em muitos momentos foi fundamental apreciá-lo com distanciamento, proporcionando o termo do trabalho que agora pretendo apresentar. O principal propósito da pesquisa era desmistificar a reputação da constante alegria do povo brasileiro. O romance Angústia manifesta dores profundas que não cabem nas perspectivas de otimistas ingênuos. Nessa obra podia-se ver o quão distante estávamos do Cândido voltairiano que acreditava estar no melhor dos mundos possíveis, como mesmo o protagonista Luís da Silva dizia: “Tantos indivíduos condenados injustamente neste mundo ruim!”. Assim, compreendi a necessidade de estudar as experiências de angústia narradas por Graciliano Ramos como parcela histórica de nossa cultura.</p><p>                                    <img src="/uploads/redactor_rails/picture/data/114/segunda-classe.jpg" width="555" height="387" style="width: 555px; height: 387px;"></p><p style="text-align: center;" rel="text-align: center;">                                  Segunda Classe (Tarsila do Amaral, 1933)</p><p>Durante a pesquisa descobri também que os romances, além de experimentos técnicos das Letras, exprimiam muitas outras formas de conhecimentos. Desse modo, o livro resultante da pesquisa procurou tratar de diversos assuntos abordados em Angústia. O encadeamento do livro se dá por meio da análise da relação entre os símbolos dos bichos às temáticas do romance. As angústias do momento histórico e os bichos que povoam essa obra de Graciliano Ramos são as principais questões pensadas. Na obra Angústia a cobra sufoca o coronel decadente, os ratos invadem a cidade, e o protagonista sente-se como um gato vingador das ofensas sofridas. Coronelismo, cangaço, cinema, os hábitos das melindrosas, a corrupção da imprensa, a cultura bacharelesca, as vicissitudes políticas da década de 1930 como um marco histórico são algumas das temáticas presentes no livro Experiências Tropicais de Angústia.</p><p><img src="/uploads/redactor_rails/picture/data/121/gato_e_rato.png"></p><p><span></span></p><p>Na trajetória da composição desse livro tornei-me pesquisadora. A Universidade do Estado do Rio de Janeiro abrigou esse projeto que perpassou o período final da minha graduação e do Mestrado na área de História, concluído em 2016. Atualmente, leciono no ensino básico, sou redatora de materiais didáticos disponibilizados na internet e estou me preparando para ingressar no Doutorado. A continuidade aos estudos possibilitará a ampliação da pesquisa sobre a produção literária da década de 1930, abrangendo os romancistas nordestinos Graciliano Ramos, José Lins do Rego e Rachel de Queiroz.</p><p><img src="/uploads/redactor_rails/picture/data/115/circulo_maceio.png"><br></p><p>Nesta campanha pretendo disponibilizar para o maior número de pessoas esse trabalho de pesquisa sobre a obra de Graciliano Ramos e a década de 1930. Para isso preciso do seu apoio! Colabore com a quantia referente ao livro ou mais, para em breve torná-lo uma realidade. A principal recompensa que você receberá apoiando esta campanha será o livro físico. Você poderá também cooperar mais e ganhar uma ecobag e um lápis com a capa e nome do livro, além de receber o livro autografado e com dedicatória. Contribua para a divulgação desse estudo e incentivo à cultura!</p><p>Texto adaptado da obra Experiências Tropicais de Angústia.</p><p>Referências externas: <br>RAMOS, Graciliano. Angústia(romance). 1.ed. Rio de Janeiro: J. Olympio, 1936.<br>VOLTAIRE. Cândido, ou O Otimismo. São Paulo: Abril Cultural, 1979.</p><p><br></p><p>            <img src="https://trello-attachments.s3.amazonaws.com/595b13a746158ed1e1db644f/600x441/0c3ace4411643f535db4044a91beeeae/CUSTOS.png" width="505" height="374" style="width: 505px; height: 374px;"><br></p>	t	\N	experienciasdeangustia	\N	online	91	2017-08-16 16:16:55.610886+00	\N	\N	Capa_Evento_-_Literatura_ST.png	https://www.youtube.com/embed/pZdG1pglAeU	user_menu_my_projects	2017-08-16 12:52:00.714264	Natália Fontes Rodrigues	\N	\N	\N	\N	\N	\N	\N	'angust':4A,12B 'experienc':1A,9B 'experienciasdeangust':5C 'histor':13B 'livr':8B 'publicaca':6B 'tropic':2A,10B	\N	2017-11-16 01:59:59.999999	f	f	f
38	Mapa de Acessibilidade	144	1	18000.0	Tornando as universidades acessíveis para todos!	\N	\N	2017-08-03 14:12:29.345074	2017-08-09 22:37:46.647477	<p>O respeito e a valorização das pessoas com deficiência e/ou mobilidade reduzida, a promoção de seus direitos, a superação das barreiras sociais predominantes ao processo de inclusão, são de grande importância. Para atuar nesse contexto surgiu  o ReAbilitArte. Um de nossos projetos é o mapa de acessibilidade, que reuniu uma equipe transdisciplinar com o objetivo de elaborar um aplicativo colaborativo que vai geolocalizar as rotas, prédios e serviços, indicando seu grau de acessibilidade. Será como um Waze da acessibilidade, indicando a melhor rota dentro dos prédios e vias das universidades para cadeirantes, pessoas com mobilidade reduzida (idosos, obesos, gestantes, acidentados); reportar às autoridades competentes essas inadequações e em parceria com estas, colaborar no planejamento das obras e na identificação dos locais com maior necessidade de intervenção, propiciando assim um ambiente mais inclusivo para todos.</p><p><img src="/uploads/redactor_rails/picture/data/122/1.jpg"></p>  <p><a href="http://www.reabilitarte.org/" target="_blank"></a></p>  <p>O <strong>ReAbilitArte</strong> pretende ser uma ferramenta de transformação social para as pessoas com deficiências físicas e seus cuidadores, oferecendo informação científica, prática e trabalho no processo de reeducação e readaptação da sociedade. Além disso, temos ainda uma participação como atividade de <strong>extensão</strong> da <strong>Universidade Federal do Rio de Janeiro</strong>.</p><p><img src="/uploads/redactor_rails/picture/data/123/2.jpg" alt="" style="display: block; margin: auto;"></p>  <p><a href="https://www.facebook.com/reabilitarte.org/" target="_blank"></a></p>  <p><br></p><p><img src="/uploads/redactor_rails/picture/data/124/22.jpg"></p><p><br></p>  <p style="margin-left: 40px; text-align: center;"><strong>Mapas de Acessibilidades Inteligentes - MAI</strong></p><p><strong>O mapa de acessibilidade é um aplicativo para celulares com sistema Android e para computadores.  O mapeamento é feito de forma colaborativa. Todos os usuários podem e devem marcar os locais acessíveis e os não acessíveis. Com essas informações um sistema de inteligência artificial calcula a melhor rota de acordo com a capacidade de mobilidade do usuário.</strong></p><p><strong>Um exemplo: um cadeirante está em uma sala de aula na universidade e precisa ir a um banheiro. O aplicativo indica qual a melhor rota para o banheiro acessível mais próximo.</strong></p><p><strong><img src="/uploads/redactor_rails/picture/data/125/4.png"><span class="redactor-invisible-space"><br></span></strong></p><p><strong><strong>Na fase piloto do Mapa (aplicativo em desenvolvimento), foi mapeada a acessibilidade das unidades e de todo o campi da <strong>UFRJ na ilha do Fundão/Rio de Janeiro </strong>(primeira universidade mapeada). A próxima etapa é a expansão para outras instituições de ensino, englobando todos os espaços públicos e privados.</strong><span class="redactor-invisible-space"><br></span></strong></p><p><strong><span class="redactor-invisible-space"><img src="/uploads/redactor_rails/picture/data/126/5.png"><span class="redactor-invisible-space"><br></span></span></strong></p><p>Vamos usar os recursos arrecadados da seguinte forma:<br></p>  <p>1. Custear o deslocamento de pessoas portadoras de qualquer tipo de deficiência que sejam colaboradoras do projeto e que nos ajudam na realização do mapeamento;  </p>  <p>2. Contratação de profissionais de T.I. para terminar o desenvolvimento da plataforma (aplicativos para celulares e para computadores);</p><p>3. Custear o servidor em que o aplicativo fica hospedado na web.</p>  <p>4. Desenvolvimento de tecnologias e adaptações assistivas para o aplicativo.</p>  <p><strong><u>Missão</u></strong></p>  <p>Proporcionar reabilitação neuro locomotora de excelência, priorizando o atendimento da população de baixa renda do subúrbio do Rio de Janeiro, através de intervenções locais em educação, prevenção, tratamento e pesquisa clínica.</p><p><img src="/uploads/redactor_rails/picture/data/127/6.png" width="265" height="213" style="width: 265px; height: 213px;"></p><p>O movimento para inclusão social das pessoas com deficiência (PCD) começou após a <strong>Segunda Guerra Mundial </strong>quando ocorreu a elaboração da: Declaração Universal dos Direitos Humanos, pela Assembléia Geral da Organização das Nações Unidas - ONU, em <strong>1948</strong>.<br></p>  <p><strong>Somente em 1993</strong>, foi instituída no Brasil uma Política Nacional para a Integração da Pessoa Portadora de Deficiência, na qual suas diretrizes determinavam a inclusão da pessoa com deficiência em todas as iniciativas governamentais relacionadas à educação, saúde, trabalho, edificação pública,seguridade social, transporte, habitação, cultura, esporte e lazer (BRASIL,1993, art. 5º, inc. III).</p>  <p><img src="/uploads/redactor_rails/picture/data/128/7.png"></p><br> <p><img src="/uploads/redactor_rails/picture/data/129/8.png"></p><p><img src="/uploads/redactor_rails/picture/data/130/9.png"></p><br>         <p><strong>Mesmo com todas essas políticas que vêm sendo adotadas nessas últimas décadas, a participação de PCDs no mercado de trabalho ainda é insignificante e para que essas pessoas consigam entrar no mercado de trabalho se faz necessário sua qualificação, o que significa inseri-las no contexto das Universidades. E estas também precisam se adaptar para recebê-las, com instalações adequadas.</strong></p><p><strong><br></strong></p><p><strong></strong></p><p><strong><img src="/uploads/redactor_rails/picture/data/132/11.png"></strong></p><strong><p>Esse projeto inovador é muito importante para possibilitar e facilitar o acesso desta expressiva parcela da população ao ensino superior. Pedimos seu apoio financeiro para que possamos manter o desenvolvimento do Mapa de Acessibilidade e expandir sua aplicação para outras Universidades e outros ambientes como restaurantes, bares, condomínios, pontos turísticos, etc. Assim estaremos proporcionando um ambiente mais acessível e inclusivo para todas as pessoas.<br></p><p><br></p><br></strong>        <h1><br></h1>	f	\N	mapa	\N	draft	60	\N	\N	\N	capa.jpg	https://www.youtube.com/embed/UtSPgltLqkY	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	'acessibil':3A 'acessiv':8B 'map':1A,4C 'mobil':11B 'tod':10B 'torn':5B 'transport':13B 'univers':7B	\N	\N	f	f	f
