45	PROGRAMA DE MAPEAMENTO E CATALOGAÇÃO DAS UNIDADES TERRITORIAIS TRADICIONAIS DA NAÇÃO JEJE MAHIN      	271	24	20000.0	Contribua para o processo de empoderamento da Cultura do Povo Tradicional de Matriz Africana	\N	\N	2017-09-10 22:50:36.706198	2017-09-21 21:02:48.313758	<p>Este programa, que dispõe de fim acadêmico cientifico, composto por projetos distintos, visa orientar as lideranças Jeje Mahin, sobre a necessidade de Mapeamento de Catalogação para posterior identificação da descendência e a fortalecimento institucional da comunidade tradicional.</p>  <p>A primeira etapa do projeto, é o 1º Colóquio Nacional de Orientação para o Processo de Mapeamento e Catalogação, que teve sua primeira edição no dia 29/08/2017, no auditório Roquette-Pinto, Palácio Quinta da Boa Vista, São Cristóvão, Rio de Janeiro/RJ, Museu Nacional/UFRJ, coordenado regionalmente pelo Professor Prof. Dr. Edmundo Marcelo Mendes Pereira – Chefe do Departamento de Antropologia (MN/UFRJ) e Pesquisador vinculado ao Laboratório de Pesquisas em Etnicidade, Cultura e Desenvolvimento (LACED-MN/UFRJ).</p>  <p>Haverão ainda mais 6 (seis) edições do Colóquio, que acontecerão na Universidade de São Paulo - USP/UNIFESP, na Universidade de Minas Gerais - UFMG, na Universidade de Brasília - UnB/FIOCRUZ, na Universidade Federal de Pernambuco - UFPE, na Universidade da Bahia – UFBA e na Universidade.</p>  <p>Os 7 (sete) encontros regionais do Colóquio Nacional, iniciará a Catalogação da descendência para posterior registro na Casa Matriz do Seja Hunde, Roça do Ventura.</p>  <p>É importante frisar que o Zogbodo Male Bogun Seja Hunde, Roça do Ventura, é uma Unidade Territorial Tradicional – UTT, declarada Patrimônio Material e Imaterial, pelo governo brasileiro, através da Portaria n° 21, de 25 de Março de 2015, do Ministério da Cultura, após relatório e aprovação do Conselho Consultivo do Instituto do Patrimônio Histórico e Artístico Nacional – IPHAN.</p>  <p>O cunho cientifico deste Programa está inserido na disseminação acadêmica e atuação dos cursos Superiores de Tecnologia de Comunicação Institucional, Gestão Pública e na interface com a Ciência da Informação e Redes de Computadores na disponibilização segura dos dados coletados, através de sites, revistas, mídias digitais e afins.</p>	f	\N	deleted_project_45	\N	deleted	60	\N	\N	\N	CONVITE_DEFINITIVO.jpg	https://www.youtube.com/embed/pmFU2wyayqw	home_banner	2017-09-11 00:06:22.63545	\N	\N	\N	\N	\N	2017-09-12 16:41:03.934827	\N	\N	'45':16C 'african':30B 'catalogaca':5A 'contribu':17B 'cultur':24B 'deleted':14C 'empoder':22B 'histor':31B 'jej':12A 'mahin':13A 'mapeament':3A 'matriz':29B 'naca':11A 'pov':26B 'process':20B 'program':1A 'project':15C 'territori':8A 'tradicion':9A 'tradicional':27B 'unidad':7A	\N	\N	f	f	f
36	Oriximiná - Ciência e Vida Quilombola	141	33	35000.0	O Documentário Oriximiná é um filme com alma, cultura, ciência e natureza. Colabore!!!	\N	\N	2017-07-18 17:39:28.634707	2017-11-14 15:44:29.023798	<p>"Oriximiná - Ciência e Vida Quilombola" é um\r\ndocumentário que foi produzido com base em uma expedição científica realizada\r\npelo Instituto de Pesquisas de Produtos Naturais e pela Faculdade de Farmácia\r\nda Universidade Federal do Rio de Janeiro (UFRJ), às Comunidades Quilombolas de\r\nOriximiná, no Estado do Pará, em um trabalho de bioprospecção da biodiversidade\r\nda Floresta Amazônica.</p><p><img src="/uploads/redactor_rails/picture/data/137/Pano_de_Fundo.JPG" width="234" height="176" alt="" style="width: 234px; height: 176px; float: left; margin: 0px 10px 10px 0px;"></p><p><img src="/uploads/redactor_rails/picture/data/136/DSC06882.JPG" width="266" height="175" style="width: 266px; height: 175px;"></p><p>É importante destacar que esse foi o primeiro projeto do Brasil\r\na receber autorização para acesso ao conhecimento tradicional associado com fins\r\nde bioprospecção, envolvendo contrato de repartição de benefícios entre\r\nUniversidade e Comunidades. Portanto, esse documentário vem a ser um dos\r\nretornos para as comunidades quilombolas de Oriximiná, da pesquisa lá\r\nrealizada.</p><p><img src="/uploads/redactor_rails/picture/data/138/DSC08593.JPG" width="251" height="188" alt="" style="width: 251px; height: 188px; float: left; margin: 0px 10px 10px 0px;"><img src="/uploads/redactor_rails/picture/data/140/DSC08620.JPG" width="253" height="189" alt="" style="width: 253px; height: 189px; float: left; margin: 0px 10px 10px 0px;"></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><iframe style="width: 500px; height: 281px;" src="//www.youtube.com/embed/uMHtK9TxfLA" frameborder="0" allowfullscreen=""></iframe><p>Além\r\nde ser um importante registro sociocultural dos remanescentes de quilombos de\r\nOriximiná, essa produção revela a riqueza da cultura medicinal desse grupo,\r\nconstruída a partir de matrizes africana, portuguesa e cabocla, cujo\r\nentendimento e preservação se traduzirão em mais saúde e qualidade de vida em\r\nbenefício de toda sociedade, e do ambiente em que vivemos.</p><p><img src="https://entropiacoletiva.com/uploads/redactor_rails/picture/data/141/DSC08378.JPG" width="241" height="181" alt="" style="width: 241px; height: 181px; float: left; margin: 0px 10px 10px 0px;"></p><p><img src="/uploads/redactor_rails/picture/data/143/DSC08106.JPG" width="243" height="181" style="width: 243px; height: 181px;"></p><p><img src="/uploads/redactor_rails/picture/data/146/DSC07629.JPG" width="242" height="183" alt="" style="width: 242px; height: 183px; float: left; margin: 0px 10px 10px 0px;"></p><p><img src="/uploads/redactor_rails/picture/data/147/DSC07610.JPG" width="243" height="181" style="width: 243px; height: 181px;"></p><iframe style="width: 500px; height: 281px;" src="//www.youtube.com/embed/7AiAxYue4mY" frameborder="0" allowfullscreen=""></iframe><p>Com\r\no propósito de dar continuidade à finalização do documentário, será lançada no\r\ndia 04 de julho uma campanha de financiamento científico/cultural pela\r\nplataforma Entropia Coletiva.</p><p><img src="/uploads/redactor_rails/picture/data/144/DSC06518.JPG" width="250" height="166" alt="" style="width: 250px; height: 166px; float: left; margin: 0px 10px 10px 0px;"></p><p><img src="/uploads/redactor_rails/picture/data/145/DSC06695.JPG" width="246" height="165" style="width: 246px; height: 165px;"></p><p>Para\r\nsaber mais sobre o PROJETO e as recompensas de participação na campanha,\r\nacompanhe nossa fanpage no Facebook e não deixe de curtir e COMPARTILHAR. Confira!!!</p><p><a href="https://www.facebook.com/Oriximin%C3%A1-Ci%C3%AAncia-e-Vida-Quilombola-231391120685110/">https://www.facebook.com/Oriximiná-Ciênc...</a></p><p><img src="/uploads/redactor_rails/picture/data/164/grafico_orcamento.png"></p><p><img src="/uploads/redactor_rails/pictu