136	ricardo.kalid@gmail.com	Ricardo Kalid	f	2017-07-03 23:35:22.052574	2017-07-03 23:35:22.915905	f	\N	\N	\N	\N	\N	\N	\N	\N	pt	\N	$2a$10$uUYQrLzNLHGnqkIYlUe0MekvuY..h50tx1xZdsEW6i/XYnVYOTRRa	\N	\N	\N	1	2017-07-03 23:35:22.913742	2017-07-03 23:35:22.913742	187.62.203.27	187.62.203.27	\N	\N	\N	18835762_1417810678295437_2677611658941893318_n.jpg	\N	\N	\N	\N	\N	\N	\N	737b4661ab28b44a6b4eeffa6e700f71	f	\N	\N	\N	t	\N	\N
97	alabi.leticia@gmail.com	Letícia Paola Alabí	f	2016-12-06 18:25:43.886371	2017-01-16 00:00:47.663315	f	\N	\N	\N	\N	\N	\N	\N	\N	pt	\N	$2a$10$FaM9NeJykxPi1GKIAuRzk.GQyL6pYjtb52M9zuHSjZcqG57KkJu4C	\N	\N	\N	32	2017-01-16 00:00:47.660807	2017-01-10 21:42:34.650376	177.32.94.15	187.50.110.139	paola_alabi	https://www.facebook.com/paolaalabi	\N	Leti.jpg	\N	\N	\N	\N	\N	\N	\N	675e6a7670029be21c2bb60ed4229404	f	<p>Sou Letícia Alabi, bacharel em Ciências & Tecnologia, bióloga e mestre pela Universidade Federal do ABC, em São Paulo, essa pesquisa teve suas raízes em 2009 em colaboração com o Instituto de Astronomia da USP (IAG-USP) e o LNLS sob orientação dos pesquisadores Dr. Douglas Galante e professor Dr. Fabio Rodrigues (Instituto Química, IQ-USP). </p><p>Atualmente estou em San Sebastian, Espanha, na Escola de <a href="http://www.ehu.eus/es/web/masterfilosofiacienciayvalores/aurkezpena">Master</a> y <a href="http://www.ehu.eus/es/web/doctoradofilosofiacienciayvalores/aurkezpena">Doctorado do País Basco (UPV-EHU)</a>. Aqui pretendemos entender o que é o “<strong>Universal</strong>” do Darwinismo (na definição de Ruiz-Mirazó “<em>capacidade de evolução aberta</em>”. Calma, não se assustem, explicaremos abaixo no que chamamos de <em>Open-endend evolution</em>) e quais os <strong>ingredientes</strong> necessários para estendê-lo. </p><p><br></p><p><strong>Como surgiu o interesse na área</strong></p><p>Conheçam um pouco de como e onde ganhamos inspiração para entrar nesta área de estudo. Gravando com Dr. Douglas Galante e suas primeiras orientandas Tamires Gallo e Leticia Paola Alabi no LNLS (Laboratório Nacional de Luz Sincronton) Campinas São Paulo. </p><p>A reportagem faz parte da apresentação do curso interdisciplinar de Ciências Moleculares da USP e está disponível completa <a href="http://redeglobo.globo.com/globouniversidade/videos/v/ciencias-moleculares/1551083/#/Edi%C3%A7%C3%B5es/20110702/page/1">aqui</a>.  O produto do contato com a área foi a defesa do 1° trabalho em Astrobiologia de conclusão de curso em Ciências Biológicas da UFABC. </p><p style="text-align: center;"><a href="https://www.academia.edu/24745851/Biological_Pigments_as_candidates_for_biosignaturas_for_Astrobiology">Biological Pigments as candidates for biosignaturas for Astrobiology</a></p><p>Disponível online: <a href="https://www.youtube.com/watch?v=_RnG-jgiquI&feature=youtu.be">Parte I </a> & <a href="https://youtu.be/kw8rmSESI1A">Parte II</a>.  Essas raízes se frutificaram em uma defesa de mestrado sob orientação do professor Dr. Charles Morphy D. dos Santos, para abrirem um pouquinho a boca: </p><p style="text-align: center;"><a href="https://www.academia.edu/7883450/Darwinismo_Universal_%C3%A0_luz_da_auto-organiza%C3%A7%C3%A3o_implica%C3%A7%C3%B5es_evolutivas_na_origem_da_ordem_biol%C3%B3gica">Darwinismo Universal à luz da auto-organização: implicações evolutivas na origem da ordem biológica</a></p><p style="text-align: center;"><a href="https://www.academia.edu/18175221/Elements_for_a_universal_philosophy_of_biology_life_and_the_origin_of_order">Elements for a universal philosophy of biology: life and the origin of order</a></p><p style="text-align: center;"><a href="https://www.cambridge.org/core/journals/international-journal-of-astrobiology/article/on-the-parallels-between-cosmology-and-astrobiology-a-transdisciplinary-approach-to-the-search-for-extraterrestrial-life/28759EDF261932CD233964686F2A9B91" target="_blank">On the parallels between cosmology and astrobiology: a transdisciplinary approach to the search for extraterrestrial life</a></p><p style="text-align: center;"><br></p><h2 style="text-align: center;"><strong>Quem somos e </strong><strong>nossas redes </strong><strong>astrobiólog</strong><strong>icas</strong></h2><h2 style="text-align: center;"><strong><i></i></strong></h2><h2 style="text-align: center;"><strong><i>A própria Terra é nosso laboratório</i></strong></h2><p><img src="/uploads/redactor_rails/picture/data/19/flish.jpg" alt="Flysch de Zumaia-Deba. Photo by Carlos Briones" height="443" width="322" style="width: 322px; height: 443px; float: left; margin: 0px 10px 10px 0px;"></p><p><a href="https://cab.inta-csic.es/es/noticias/296/finaliza-la-xiv-edicion-de-la-escuela-de-astrobiologia-josep-comas-i-sola12-07-2016"><strong>XIV International School of Astrobiology "Josep Comas i Solà"</strong></a><strong>, </strong>organizada pelo Centro de Astrobiología (CSIC-INTA), Universidad Internacional Menéndez Pelayo (UIMP) e NASA Astrobiology Institute (NAI),  contando com a participação de la Agencia Espacial Europea (ESA).</p>  <p><strong></strong></p>    <p>Nesta ocasião, a Escola se centrou nos estudos dos <strong>ambientes análogos terrestres </strong>para a busca de vida fora da Terra. Tivemos aulas a cargo de quarto professores bastante relevantes a nivel internacional:  Britney E. Schmidt (Georgia Institute of Technology, Estados Unidos), Kathy Campbell (University of Auckland, Nueva Zelanda), Gian-Gabriele Ori (Università d’Annunzio, Italia) e Ricardo Amils (CAB, España). </p>    <p style="margin-left: 40px;">Através do contato com essa equipe de astrobiólogos pudemos analisar as características dos principais entornos do nosso planeta que podem ser <strong>similares </strong>a ambientes extraterrestres com potencial de habitabilidade, incluindo glaciares e outras interfaces entre gelo e água liquida, <a name="result_box"></a>fontes hidrotermais submarinas, desertos com altos níveis de radiação, bem como as águas e subsolo do Rio Tinto (abaixo). </p><p><img src="/uploads/redactor_rails/picture/data/21/Rio-Tinto.png" alt="Río Tinto (España): A Terrestrial Analogue for Life on Mars?" style="display: block; margin: auto;"></p><p><img src="/uploads/redactor_rails/picture/data/20/Flish_2.jpg" alt="A esquerda o investigador em origem da vida Dr. Carlos Briones Llorente, do departamento de Evolução Molecular del CAB (Centro de Astrobiologia de Madrid, Espanha). A direita Dr. Britney E. Schmidt (Georgia Institute of Technology, Estados Unidos), uma das professoras da Escola de Verão em Astrobiologia.  Ao centro Leticia Alabi, representando a Universidade do Pais Basco a qual se encontra atualmente" height="273" width="363" style="width: 363px; height: 273px; float: right; margin: 0px 0px 10px 10px;"></p><p><br></p><p>Assim, avaliamos a possibilidade de que planetas ou satélites do Sistema Solar (como Marte, Europa, Ganimedes, Enceladus ou Titã) teriam abrigado formas de vida no passado. Além disso, também exploramos quais as opções de habitabilidade oferecem planetas extrassorales semelhantes à Terra que se estão caracterizando hoje.<br></p><p><br></p><p><br></p><p><img src="/uploads/redactor_rails/picture/data/22/meteoritos.jpg" alt="" height="242" width="361" style="width: 361px; height: 242px; display: block; margin: auto;">                                    Analisando meteoritos no Laboratório de Astrobiologia do Brasil.</p><img src="/uploads/redactor_rails/picture/data/23/LNLS.jpg" alt="" height="270" width="359" style="width: 359px; height: 270px; margin: auto; display: block;"><p>Analisando extremófilos no Laboratório Nacional de Luz Sincroton, em Campinas (LNLS).</p><img src="/uploads/redactor_rails/picture/data/24/Leti_1.jpg" alt="" height="316" width="422" style="width: 422px; height: 316px; display: block; margin: auto;"><p>Divulgação científica pelo (s) mundo (s).</p><img src="/uploads/redactor_rails/picture/data/25/Leti_2.jpg" alt="" height="283" width="378" style="width: 378px; height: 283px; display: block; margin: auto;"><p><br></p><p><img src="/uploads/redactor_rails/picture/data/26/Leti_3.jpg" alt="" style="display: block; margin: auto;"></p><p><img src="/uploads/redactor_rails/picture/data/28/Leti_5.jpg" alt="" style="display: block; margin: auto;"></p><p><br></p><p><img src="/uploads/redactor_rails/picture/data/56/divulgacao_cientifica.JPG" alt="" style="display: block; margin: auto;"></p>	capa_entropia_coletiva.jpeg	\N	f	\N	\N
