139	higor.alvarenga95@gmail.com	ReAbilitArte	f	2017-07-15 18:38:09.546674	2017-08-03 13:58:25.659074	f	\N	\N	\N	\N	\N	\N	\N	\N	pt	\N	$2a$10$uAeL5UIVUAqsMwy8h6GIU.gqD.gE.gCjJbAOnq34p/CGbP5HODDo2	\N	\N	\N	11	2017-07-16 21:01:04.161214	2017-07-16 20:45:29.598371	179.192.106.214	179.198.106.64		https://www.facebook.com/reabilitarte.org/	\N	logo_peito_esquerdo_frontal.png	\N	\N	\N	\N	\N	\N	\N	3d893fd259a81facbdc09bc0f461590a	f	<p>Fundada em 2009, a ReAbilitArte (RAA) vise promover um moderno serviço de saúde que estabeleça interface entre reabilitação física, pesquisa e serviço social, tornando possível o atendimento individualizado e humanizado aos deficientes físicos no Rio de Janeiro, principalmente para a população mais vulnerável.</p><p><br><br>O projeto ReAbilitArte baseia-se em alguns princípios:<br>· Para poder exercer seu direito<span class="text_exposed_show"> de levar uma vida ativa, o deficiente físico precisa manter sua autonomia e se capacitar para garantir sua inclusão na sociedade.<br>· A completa Reabilitação envolve tratamento clínico individualizado e intervenção psico-social;<br>. A educação leva à formação de uma sociedade mais informada, democrática, responsável e inclusiva, propiciando uma melhor qualidade de vida.</span></p><p><br><br>A produção e divulgação científica são estimuladas nas diversas áreas que compõem a rede do cuidar, dentre elas: ArteTerapia, Assistência Social, Bioquímica, Clínica, Cardiologia, Cirurgia, Educação Física, Enfermagem, Farmacia, Fisiatria, Fisioterapia, Fonoaudiólogia, Infectologia, Materiais e Processos, Mecânica, MúsicoTerapia, Neurologia, Nutrição, Ortopedia, Portabilidade, Psicólogia, Robótica, Software, Terapia Ocupacional,.. e outras.</p>	\N	\N	t	\N	\N
