144	contato@reabilitarte.org	ReAbilitArte	f	2017-08-03 14:12:00.78398	2017-08-03 14:19:19.590791	f	\N	\N	\N	\N	\N	\N	\N	\N	pt	\N	$2a$10$64joi9TANeugIAK.9bOg8eujcHPQIyd4zNtotA1ItPJLsZxtF9vKi	\N	\N	\N	1	2017-08-03 14:12:02.211912	2017-08-03 14:12:02.211912	146.164.20.68	146.164.20.68		https://www.facebook.com/reabilitarte.org/	\N	logo_peito_esquerdo_frontal.png	\N	\N	\N	\N	\N	\N	\N	e6e7b8032e4238f1996075d69db2a8ad	f	<p>Fundada em 2009, a ReAbilitArte (RAA) vise promover um moderno serviço de saúde que estabeleça interface entre reabilitação física, pesquisa e serviço social, tornando possível o atendimento individualizado e humanizado aos deficientes físicos no Rio de Janeiro, principalmente para a população mais vulnerável.</p><p>O projeto ReAbilitArte baseia-se em alguns princípios:<br>· Para poder exercer seu direito<span class="text_exposed_show"> de levar uma vida ativa, o deficiente físico precisa manter sua autonomia e se capacitar para garantir sua inclusão na sociedade.<br>· A completa Reabilitação envolve tratamento clínico individualizado e intervenção psico-social;<br>. A educação leva à formação de uma sociedade mais informada, democrática, responsável e inclusiva, propiciando uma melhor qualidade de vida.</span></p><p>A produção e divulgação científica são estimuladas nas diversas áreas que compõem a rede do cuidar, dentre elas: ArteTerapia, Assistência Social, Bioquímica, Clínica, Cardiologia, Cirurgia, Educação Física, Enfermagem, Farmacia, Fisiatria, Fisioterapia, Fonoaudiólogia, Infectologia, Materiais e Processos, Mecânica, MúsicoTerapia, Neurologia, Nutrição, Ortopedia, Portabilidade, Psicólogia, Robótica, Software, Terapia Ocupacional,.. e outras.</p>	capa2.jpg	\N	t	\N	\N
