283	antunes@ensp.fiocruz.br	Caetano Antunes	f	2017-09-10 16:43:27.664525	2017-09-11 01:41:58.128711	f	\N	\N	\N	\N	\N	\N	\N	\N	pt	\N	$2a$10$zdasEgd8KcoY6Lou8MufrOPSFDJoqXL2vRnrI2yRBRowHkjFYYIsS	\N	\N	\N	1	2017-09-10 16:43:27.67721	2017-09-10 16:43:27.67721	187.78.172.126	187.78.172.126			\N	Caetano.jpg	\N	\N	\N	\N	\N	\N	\N	992668842355d1e086b74f450f8a33e8	f	<p>Português (English below): Durante meu curso de graduação em Microbiologia e Imunologia, na UFRJ, fiquei fascinado com as bactérias benéficas que vivem em nosso corpo, principalmente no intestino. Tais bactérias formam uma comunidade complexa, chamada de microbiota, e que tem funções importantíssimas para o funcionamento do nosso organismo. Já no mestrado, também na URJ, descobri um outro assunto com o qual fiquei também fascinado. Descobri que as bactérias se comunicam! Elas fazem isso através da produção de pequenas moléculas, que são produzidas e excretadas no ambiente. Outras bactérias podem então sentir essas moléculas, e modificar seu comportamento de acordo com a mensagem recebida. Por isso, durante meu mestrado eu desenvolvi pesquisas para detectar esta comunicação bacteriana justamente na microbiota intestinal, e publiquei o primeiro trabalho mostrando que essa comunicação ocorria em uma das bactérias mais comuns da microbiota intestinal. Para o doutorado, eu queria me aprofundar na área de comunicação bacteriana, e por isso fui para o exterior, onde trabalhei no laboratório de um dos cientistas que descobriram este fenômeno, na Universidade de Iowa (EUA). Lá continuei pesquisas sobre comunicação bacteriana, mas usando um modelo de microbiota de lula. Após o doutorado, resolvi voltar à comunicação bacteriana do intestino, e decidi realizar meu pós-doutorado na Universidade da Columbia Britânica (Canadá), trabalhando com um pesquisador renomado na pesquisa sobre bactérias intestinais causadoras de doenças. Lá desenvolvi uma série de estudos, todos voltados para o entendimento da comunicação bacteriana no intestino. Em 2012 voltei para o Brasil através de uma bolsa de Atração de Jovens Talentos, do CNPq. Pouco tempo depois fui aprovado em concurso público para a Fundação Oswaldo Cruz, onde trabalho até hoje desvendando fenômenos de comunicação bacteriana. Tais estudos tem o objetivo de entender estes processos em detalhes, assim como utilizar esses fenômenos como alvos para novas drogas antibióticas.</p><p>English: As an undergraduate student in Microbiology and Immunology at the Federal University of Rio de Janeiro (UFRJ), I became fascinated by the beneficial microbes that inhabit our bodies, especially in the intestinal tract. These microbes form a complex community, termed microbiota, which has critical functions for the correct functioning of our bodies. During my master's program, also at UFRJ, I came into contact with yet another subject that fascinated me. I found out that bacteria can communicate! They do so by producing small molecules and secreting them into the environment. Other microbes can then sense these molecules, and modify their behaviour according to the message received. This prompted me to develop my research with a focus on detecting bacterial communication in the intestinal microbiota. This allowed me to publish the first report showing that one of the most prominent genus of bacteria in the human gut also employs this communication tool. During my Ph.D. I wanted to delve deeper into microbial communication, and this led me to pursue my studies abroad, in the laboratory of Pete Greenberg, one of the first scientists to study this phenomenon, at the University of Iowa (USA). There, I continued my research on bacterial communication, using a microbiota model of the Hawaiian squid, Euprymna scolopes. After obtaining my Ph.D., I decided to go back to researching microbial communication in the gut, and, therefore, went on to pursue my post-doctoral studies at the University of British Columbia (Canada), in the laboratory of Brett Finlay, a world leader in the area of enteric pathogens. During my postdoc, I developed several projects, all with a goal of understanding bacterial communication in the gut. In 2012 I returned to Brazil, with a Young Talent Attraction Fellowship from the Science without Borders program of the National Counsel for Scientific and Technological Development. Soon after, I secured a position at the Oswaldo Cruz Foundation, the leading research organization in Brazil, where I have been working to unveil mechanisms of bacterial communication. My current studies have the ultimate goal of understanding these processes in detail, as well as utilize this knowledge for the development of new therapeutics. </p>	\N	\N	t	\N	\N
