m concluídas a tempo de dar espaço às fases determinantes de cada uma das minhas conquistas. Espero poder obter através de apoio às minhas ideias um protótipo para testes dos materiais que estou pesquisando.</p>	20170709_163226.jpg	\N	t	\N	\N
